insert  into `tbl_knowledge_center_slide` values (2,3,'<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: 1.6;\"><span style=\"font-size: 10pt; font-family: Arial;\"><span style=\"color: rgb(156, 0, 255); font-weight: bold;\">What are safer-sexual practices? </span><o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: 1.6;\"><b><span style=\"font-size: 10pt; color: rgb(51, 51, 51); border: 1pt none windowtext; padding: 0in; font-family: Arial;\">A\nsexual activity in which various measures are used to avoid diseases that can\nbe transmitted through sexual contact.<o:p></o:p></span></b></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: 1.6;\"><span style=\"font-size: 10pt; font-family: Arial;\"><o:p> </o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: 1.6;\"><span style=\"font-size: 10pt; line-height: 115%; font-family: Arial;\"><span style=\"font-weight: bold; color: rgb(156, 0, 255);\">What are health concerns in risky sexual behaviour?</span><o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: 1.6;\"><b><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: Arial; color: rgb(0, 0, 0);\" lang=\"EN-IN\">A person can be at risk if they indulge in certain\nsexual acts when there is a possibility of getting infected with an STI\nincluding HIV. HIV, STIs/STDs, sexual abuse and violence are some very common\nhealth concerns in a risky sexual behaviour. <o:p></o:p></span></b></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: 1.6;\"><b><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: Arial; color: rgb(0, 0, 0);\" lang=\"EN-IN\"><o:p> </o:p></span></b></p>\n\n<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-bottom: 0.0001pt; text-align: justify; text-indent: -0.25in; line-height: 1.6;\"></p><ul><li><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\"></span><span style=\"color: rgb(0, 0, 0); font-family: Arial; text-indent: -0.25in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 10pt;\" lang=\"EN-IN\">Violence against MSM and\ntransgender people in India is rarely reported as there is still a lot of\nstigma associated with being a homosexual in India.</span></li></ul><ul><li><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\"> </span><span style=\"color: rgb(0, 0, 0); font-family: Arial; text-indent: -0.25in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 10pt;\" lang=\"EN-IN\">Violence is experienced\nin different forms such as sexual violence or verbal violence (within partners,\npolice, friends, community/clients, etc.), physical violence, blackmailing and\nextortion of money.</span></li></ul><ul><li><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\"> </span><span style=\"color: rgb(0, 0, 0); font-family: Arial; text-indent: -0.25in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 10pt;\" lang=\"EN-IN\">Sexual abuse exists in\ndifferent forms also such as</span><br></li></ul><!--[if !supportLists]--><p></p>\n\n\n\n\n\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin: 0in 0in 0.0001pt 1in; text-align: justify; text-indent: -0.25in; line-height: 1.6;\"><!--[if !supportLists]--><span style=\"font-family: Arial; color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt;\" lang=\"EN-IN\">o<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">   \n</span></span><!--[endif]--><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">physical sexual abuse\n(touching private parts i.e. in family, school, college, etc.; sexual assault,\nrape, incest)<o:p></o:p></span></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin: 0in 0in 0.0001pt 1in; text-align: justify; text-indent: -0.25in; line-height: 1.6;\"><span style=\"font-family: Arial;\"><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 0, 0);\" lang=\"EN-IN\"><br></span></span></p>\n\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin: 0in 0in 0.0001pt 1in; text-align: justify; text-indent: -0.25in; line-height: 1.6;\"><!--[if !supportLists]--><span style=\"font-family: Arial; color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt;\" lang=\"EN-IN\">o<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">  </span></span><!--[endif]--><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">mental sexual abuse\n(showing pornographic material, emotional harassment, incest or forced sexual\nrelations between family members)<o:p></o:p></span></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin: 0in 0in 0.0001pt 1in; text-align: justify; text-indent: -0.25in; line-height: 1.6;\"><span style=\"font-family: Arial;\"><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 0, 0);\" lang=\"EN-IN\"><br></span></span></p>\n\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin: 0in 0in 0.0001pt 1in; text-align: justify; text-indent: -0.25in; line-height: 1.6;\"><!--[if !supportLists]--><span style=\"font-family: Arial; color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt;\" lang=\"EN-IN\">o<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">      </span></span><!--[endif]--><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">verbal sexual abuse\n(comments in a sexual language)<o:p></o:p></span></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin: 0in 0in 0.0001pt 1in; text-align: justify; text-indent: -0.25in; line-height: 1.6;\"><span style=\"font-family: Arial;\"><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 0, 0);\" lang=\"EN-IN\"><br></span></span></p>\n\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin: 0in 0in 0.0001pt 1in; text-align: justify; text-indent: -0.25in; line-height: 1.6;\"><!--[if !supportLists]--><span style=\"font-family: Arial; color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt;\" lang=\"EN-IN\">o<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">   \n</span></span><!--[endif]--><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">psychological\n(intimidation, bullying, non-consensual and forced physical sexual behaviour). <o:p></o:p></span></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin: 0in 0in 0.0001pt 1in; text-align: justify; text-indent: -0.25in; line-height: 1.6;\"><span style=\"font-family: Arial;\"><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 0, 0);\" lang=\"EN-IN\"><br></span></span></p>\n\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-bottom: 0.0001pt; text-align: justify; text-indent: -0.25in; line-height: 1.6;\"></p><ul><li><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\"> </span></span><span style=\"font-family: Arial; text-indent: -0.25in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 10pt;\" lang=\"EN-IN\">Services for people who\nface sexual violence include immediate medical referrals, linking with legal\nsupport, immediate and long-term mental health counseling and free legal aid\nservices.</span></span><br></li></ul><!--[if !supportLists]--><p></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: 1.6;\"></p>','','<div style=\"line-height: 2;\"><span style=\"font-weight: bold;\"><span style=\"color: rgb(156, 0, 255);\"><span style=\"font-family: Arial Black;\">जोखिम भरा यौन व्यवहार में स्वास्थ्य से जुड़ी चिंताएं क्या हैं ?</span></span></span><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-weight: bold;\"><br>एचआईवी संक्रमित व्यक्ति से यौन संबंध स्थापित करने पर उस व्यक्ति को भी एचआईवी से संक्रमित होने की संभावना है।एचआईवी, एसटीआई/एसटीडी, यौन शोषण और हिंसा जोखिम भरा यौन व्यवहार में एक बहुत ही सामान्य स्वास्थ्य विषय है।</span><br></span><ul><li><span style=\"color: rgb(0, 0, 0);\"> भारत में एमएसएम, हिंजडा और ट्रांसजेंडर लोगों के खिलाफ हिंसा की सूचना बहुत ही कम मिलती है फिर भी भारत में समलैंगिकों के साथ एवं उनसे जुडे़ भेदभाव बहुत है।</span></li></ul><span style=\"color: rgb(0, 0, 0);\"></span><ul><li><span style=\"color: rgb(0, 0, 0);\"> हिंसा, के अलग-अलग प्रकार के है जैसे यौन हिंसा या मौखिक हिंसा (अपने पार्टनर के साथ, पुलिस, दोस्तों, सामुदायिक/ग्राहकों के साथ, आदि), शारीरिक हिंसा, ब्लैकमेल और पैसे की जबरन वसूली के रूप में विभिन्न रूपों में।</span></li></ul><span style=\"color: rgb(0, 0, 0);\"></span><div style=\"text-align: left;\"><div style=\"text-align: left;\"><ul><li><span style=\"color: rgb(0, 0, 0);\"> यौन शोषण भी अलग-अलग प्रकार के है जैसे</span></li></ul></div><span style=\"color: rgb(0, 0, 0);\"></span></div><span style=\"color: rgb(0, 0, 0);\"></span><ul><li><span style=\"color: rgb(0, 0, 0);\"> शारीरिक यौन हिंसा (परिवार, स्कूल या कॉलेज में शरीर के प्राइवेट अंगों को छूना, यौन उत्पीड़न, बलात्कार, व्यभिचार)</span></li></ul><span style=\"color: rgb(0, 0, 0);\"></span><ul><li><span style=\"color: rgb(0, 0, 0);\"> मानसिक यौन शोषण के अलग अलग रूपों में मौजूद है (अश्लील सामग्री    दिखाना, भावनात्मक उत्पीड़न, अनाचार या परिवार के सदस्यों के बीच यौन संबंध के लिए मजबूर करना)। </span></li></ul><span style=\"color: rgb(0, 0, 0);\"></span><ul><li><span style=\"color: rgb(0, 0, 0);\">मौखिक यौन शोषण (यौन भाषा में टिप्पणी करना), मनोवैज्ञानिक (धमकी, बदमाशी, गैर सहमति और जबरदस्ती शारीरिक यौन व्यवहार)। </span></li></ul><span style=\"color: rgb(0, 0, 0);\"></span><ul><li><span style=\"color: rgb(0, 0, 0);\">जो लोग यौन हिंसा का सामना करते है। उनको मेडिकल व तत्काल चिकित्सा रेफरल सहायता, तत्काल और लंबे समय तक मानसिक स्वास्थ्य परामर्श और निःशुल्क कानूनी सहायता उपलब्ध है।</span></li></ul></div><div style=\"line-height: 2;\"><br></div>','','N'),(3,3,'<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: 1.6;\"><b><span style=\"font-size: 10pt; font-family: Arial;\"><span style=\"color: rgb(156, 0, 255);\">What\nis sexuality?</span><o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: 1.6;\"><span style=\"font-size: 10pt; font-family: Arial; color: rgb(0, 0, 0);\" times=\"\" new=\"\" roman\";mso-bidi-font-family:=\"\" calibri;mso-bidi-theme-font:minor-latin;color:#333333;border:none=\"\" windowtext=\"\" 1.0pt;=\"\" mso-border-alt:none=\"\" 0in;padding:0in\"=\"\">Sexuality is a central aspect\nof being human and expression throughout life and includes: <o:p></o:p></span></p><ul><li><!--[if !supportLists]--><span style=\"font-family: Arial; color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; line-height: 115%;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">\n</span></span><!--[endif]--><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Sex</span></span></li></ul><span style=\" font-family: Arial; color: rgb(0, 0, 0);\"><span style=\" font-size: 10pt; line-height: 115%; background-