al; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"></span></span><ul><li><!--[if !supportLists]--><span style=\"font-family: Arial; color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; line-height: 115%;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"></span></span><!--[endif]--><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Intimacy\nand reproduction</span></span></li></ul><span style=\" font-family: Arial; color: rgb(0, 0, 0);\"><span style=\" font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"></span></span><p style=\"line-height: 1.6;\">\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n</p><ul><li style=\"line-height: 2;\"><!--[if !supportLists]--><span style=\"font-family: Arial; color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; line-height: 115%; border: 1pt none windowtext; padding: 0in;\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">\n</span></span><!--[endif]--><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Se</span><span style=\"font-size:10.0pt;line-height:115%;mso-fareast-font-family:\n\" times=\"\" new=\"\" roman\";mso-bidi-font-family:calibri;mso-bidi-theme-font:minor-latin;=\"\" color:#333333;border:none=\"\" windowtext=\"\" 1.0pt;mso-border-alt:none=\"\" 0in;=\"\" padding:0in;mso-ansi-language:en-in\"=\"\" lang=\"EN-IN\">xuality</span></span><span style=\"font-size:10.0pt;\nline-height:115%;mso-fareast-font-family:\" times=\"\" new=\"\" roman\";mso-bidi-font-family:=\"\" calibri;mso-bidi-theme-font:minor-latin;color:#333333;border:none=\"\" windowtext=\"\" 1.0pt;=\"\" mso-border-alt:none=\"\" 0in;padding:0in\"=\"\"><span style=\"font-family: Arial; color: rgb(0, 0, 0);\"> is experienced and expressed\nin thoughts, fantasies, desires, beliefs, attitudes, behaviors, practices,\nroles and relationships. <br></span></span></li></ul><span style=\" font-size:10.0pt;\nline-height:115%;mso-fareast-font-family:\" times=\"\" new=\"\" roman\";mso-bidi-font-family:=\"\" calibri;mso-bidi-theme-font:minor-latin;color:#333333;border:none=\"\" windowtext=\"\" 1.0pt;=\"\" mso-border-alt:none=\"\" 0in;padding:0in\"=\"\"><span style=\" font-family: Arial; color: rgb(0, 0, 0);\"><br></span></span>','','<div style=\"line-height: 2;\"><span style=\"font-weight: bold;\"><span style=\"color: rgb(156, 0, 255);\">लैंगिकता की अभिव्यक्ति ?</span></span></div><div style=\"line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\">लैंगिकता का उल्लेख इंसान होने का एक केंद्रीय पहलू है और इसकी अभिव्यक्ति जीवन भर होती है जिसमे यह सब शामिल है।<br></span><ul><li><span style=\"color: rgb(0, 0, 0);\">लिंग </span></li></ul><span style=\"color: rgb(0, 0, 0);\"></span></div><div style=\"line-height: 2;\"><ul><li><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>लिंग की पहचान और भूमिका </span></li></ul><span style=\"color: rgb(0, 0, 0);\"></span></div><div style=\"line-height: 2;\"><ul><li><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>लैंगिक भूमिका </span></li></ul><span style=\"color: rgb(0, 0, 0);\"></span></div><div style=\"line-height: 2;\"><ul><li><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>कामवासना (यौन की इच्छा)</span></li></ul><span style=\"color: rgb(0, 0, 0);\"></span></div><div style=\"line-height: 2;\"><ul><li><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>आनंद </span></li></ul><span style=\"color: rgb(0, 0, 0);\"></span></div><div style=\"line-height: 2;\"><ul><li><span style=\"color: rgb(0, 0, 0);\">आत्मीयता और प्रजनन </span></li></ul><span style=\"color: rgb(0, 0, 0);\"></span></div><div style=\"line-height: 2;\"><ul><li><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>लैंगिकता का अनुभव व अभिव्यक्ति विचारों, इच्छाओं, रवैये, व्यवहारों, प्रथाओं, कार्यों आदि के द्वारा किया जाता है।</span></li></ul><span style=\"color: rgb(0, 0, 0);\"><br></span></div><div style=\"line-height: 2;\"><br></div>','','N'),(5,3,'<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: 1.6;\"><span style=\"font-weight: bold; font-family: Arial; color: rgb(156, 0, 255);\">What\nis sexual orientation?</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: 1.6;\"><span style=\"font-size: 10pt; font-family: Arial; color: rgb(0, 0, 0);\" times=\"\" new=\"\" roman\";mso-bidi-font-family:=\"\" calibri;mso-bidi-theme-font:minor-latin;color:#333333;border:none=\"\" windowtext=\"\" 1.0pt;=\"\" mso-border-alt:none=\"\" 0in;padding:0in\"=\"\">Sexual orientation refers to a\nperson’s physical, romantic, and/or emotional attraction towards members of the\nsame sex and/or a different sex. <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: 1.6;\"><span style=\"font-size: 10pt; font-family: Arial; color: rgb(0, 0, 0);\" times=\"\" new=\"\" roman\";mso-bidi-font-family:=\"\" calibri;mso-bidi-theme-font:minor-latin;color:#333333;border:none=\"\" windowtext=\"\" 1.0pt;=\"\" mso-border-alt:none=\"\" 0in;padding:0in\"=\"\"><br></span></p><p class=\"MsoListParagraphCxSpFirst\" style=\"margin-bottom: 0.0001pt; text-align: justify; text-indent: -0.25in; line-height: 1.6;\"></p><ul><li><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"></span><span times=\"\" new=\"\" roman\";mso-bidi-font-family:calibri;mso-bidi-theme-font:minor-latin;=\"\" color:#333333;border:none=\"\" windowtext=\"\" 1.0pt;mso-border-alt:none=\"\" 0in;=\"\" padding:0in\"=\"\" style=\"color: rgb(0, 0, 0); font-family: Arial; text-indent: -0.25in; font-size: 10pt;\">A heterosexual </span><span style=\"color: rgb(0, 0, 0); font-family: Arial; text-indent: -0.25in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 10pt;\" lang=\"EN-IN\">is attracted to people of\nopposite sex, a homosexual is  attracted\nto people of same sex</span></li></ul><span style=\" color: rgb(0, 0, 0); font-family: Arial; text-indent: -0.25in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 10pt;\" lang=\"EN-IN\"></span><!--[if !supportLists]--><ul><li><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"></span><span style=\"color: rgb(0, 0, 0); font-family: Arial; text-indent: -0.25in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 10pt;\" lang=\"EN-IN\">a bisexual is attracted\nto people of both sexes and</span></li></ul><span style=\" color: rgb(0, 0, 0); font-family: Arial; text-indent: -0.25in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 10pt;\" lang=\"EN-IN\"></span><!--[if !supportLists]--><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom: 0.0001pt; text-align: justify; text-indent: -0.25in; line-height: 1.6;\"></p><ul><li><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"></span><span style=\"font-family: Arial; text-indent: -0.25in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: inherit; font-size: 10pt;\" lang=\"EN-IN\"><span style=\"color: rgb(0, 0, 0);\">an asexual is someone who\nlacks </span></span><span style=\"font-size: 10pt; color: rgb(0, 0, 0);\" lang=\"EN-IN\">sexual attraction</span><span style=\"font-family: Arial; text-indent: -0.25in; color: inherit; font-size: 10pt;\" lang=\"EN-IN\"><span style=\"color: rgb(0, 0, 0);\"> </span><span style=\"color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">to\nanyone, or low or absent interest in or</span><span style=\"color: rgb(0, 0, 0);\"> </span></span><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt;\" lang=\"EN-IN\">desire</span></span><span style=\"font-family: Arial; text-indent: -0.25in; color: rgb(0, 0, 0); font-size: 10pt;\" lang=\"EN-IN\"> <span style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">for</span> </span><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt;\" lang=\"EN-IN\">sexual activity</span></span><span style=\"font-family: Arial; text-indent: -0.25in; color: rgb(0, 0, 0); font-size: 10pt;\" lang=\"EN-IN\">.</span></li></ul><span style=\" font-family: Arial; text-indent: -0.25in; color: rgb(0, 0, 0); font-size: 10pt;\" lang=\"EN-IN\"></span><!--[if !supportLists]--><ul><li><span style=\"font-weight: bold;\"><span style=\"color: rgb(156, 0, 255);\"> F</span><span times=\"\" new=\"\" roman\";mso-bidi-font-family:calibri;mso-bidi-theme-font:minor-latin;=\"\" color:#333333;border:none=\"\" windowtext=\"\" 1.0pt;mso-border-alt:none=\"\" 0in;=\"\" padding:0in\"=\"\" style=\"color: rgb(156, 0, 255); text-indent: -0.25in; font-family: Arial; font-size: 10pt;\">eeling uncertain about sexual orientation, is common. But it is\nimportant to keep in mind that experiencing such feelings is not strange or\nabnormal.</span></span></li></ul><span style=\"font-weight: bold;\"><span times=\"\" new=\"\" roman\";mso-bidi-font-family:calibri;mso-bidi-theme-font:minor-latin;=\"\" color:#333333;border:none=\"\" windowtext=\"\" 1.0pt;mso-border-alt:none=\"\" 0in;=\"\" padding:0in\"=\"\" style=\" color: rgb(156, 0, 255); text-indent: -0.25in; font-family: Arial; font-size: 10pt;\"></span></span><ul><li><span style=\"font-weight: bold;\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"></span><span times=\"\" new=\"\" roman\";mso-bidi-font-family:=\"\" calibri;mso-bidi-theme-font:minor-latin;color:#333333;border:none=\"\" windowtext=\"\" 1.0pt;=\"\" mso-border-alt:none=\"\" 0in;padding:0in\"=\"\" style=\"color: rgb(156, 0, 255); text-indent: -0.25in; font-family: Arial; font-size: 10pt;\">Many people feel confused about\ntheir sexual orientation at some point in their lives.</span></span></li></ul><span style=\"font-weight: bold;\"><span times=\"\" new=\"\" roman\";mso-bidi-font-family:=\"\" calibri;mso-bidi-theme-font:minor-latin;color:#333333;border:none=\"\" windowtext=\"\" 1.0pt;=\"\" mso-border-alt:none=\"\" 0in;padding:0in\"=\"\" style=\" color: rgb(156, 0, 255); text-indent: -0.25in; font-family: Arial; font-size: 10pt;\"></span></span><ul><li><span style=\"font-weight: bold;\"><span style=\"text-indent: -0.25in; color: inherit; font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: Arial;\"><span style=\"color: rgb(156, 0, 255);\"> </span></span><span style=\"text-indent: -0.25in; color: inherit;\"><span style=\"text-indent: -18pt;\"><span style=\"font-size: 10pt; border: 1pt none windowtext; padding: 0cm;\" lang=\"EN-US\"><span style=\"font-family: Arial; color: rgb(156, 0, 255);\">Figuring\nout sexual orientation is not something one can do by taking a test. It is\nimportant to give time and try to listen to one’s emotions. </span></span></span></span><br></span></li></ul><p></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom: 0.0001pt; text-align: justify; text-indent: -0.25in; line-height: 1.6;\"></p><div><span style=\"color: rgb(156, 0, 255); font-family: Arial; font-size: 13.3333px;\"><br></span></div><p></p><span style=\"color: rgb(156, 0, 255); font-family: Arial; font-size: 13.3333px;\"></span><br><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom: 0.0001pt; text-align: justify; text-indent: -0.25in; line-height: 1.6;\"><span style=\"text-indent: -0.25in; font-family: Arial;\"></span></p>','','<span style=\"color: rgb(156, 0, 255); font-weight: bold;\">लैंगिक रुझानः<span style=\"color: rgb(0, 0, 0);\"> <br><br></span></span><span style=\"color: rgb(156, 0, 255);\"><span style=\"color: rgb(0, 0, 0);\">लैंगिक रुझान किसी भी समान लिंग या विपरीत लिंग के व्यक्ति के साथ शारीरिक, प्रेम और/या भावुक आकर्षण से व्यक्त होता है:<br><br></span></span><ul><li><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>विषमलैंगिकः विपरीत लिंग के व्यक्ति से आकर्षित होना</span></li></ul><span style=\"color: rgb(0, 0, 0);\"></span><ul><li><span style=\"color: rgb(0, 0, 0);\">समलैंगिकः समान लिंग के व्यक्ति से आकर्षित होना</span></li></ul><span style=\" color: rgb(0, 0, 0);\"></span><ul><li><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>द्विलिंगीः समान और विपरीत लिंग के व्यक्ति से आकर्षित होना</span></li></ul><span style=\" color: rgb(0, 0, 0);\"></span><ul><li><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>अलैंगिकः किसी दूसरे व्यक्ति की ओर यौन आकर्षण या यौन गतिविधियो में बहुत ही कम रूचि होना।</span></li></ul><span style=\" color: rgb(0, 0, 0);\"></span><ul><li><span style=\"font-weight: bold;\"><span style=\"color: rgb(156, 0, 255);\">छोटी उम्र में अपने लैंगिक रुझान के बारे में असमंजस में होना एक साधारण अवस्था है। अगर कोई व्यक्ति ऐसा कुछ अनुभव कर रहा है तो वो असामान्य या अनुचित नहीं है। <br></span></span></li></ul><span style=\"font-weight: bold;\"><span style=\"color: rgb(156, 0, 255);\"></span></span><ul><li><span style=\"font-weight: bold;\"><span style=\"color: rgb(156, 0, 255);\">कही न कही बहुत से लोग अपने लैंगिक रुझान के बारे में व्याकुल है या असमंजस में है। <br></span></span></li></ul><span style=\"font-weight: bold;\"><span style=\"color: rgb(156, 0, 255);\"></span></span><ul><li><span style=\"font-weight: bold;\"><span style=\"color: rgb(156, 0, 255);\">लैंगिक रूझान को किसी जाॅच द्वारा पता नहीं किया जा सकता। खुद के लिए वक्त देने से और अपनी भावनाओ को समझने से कुछ स्पष्टता आ सकती है।</span></span></li></ul><p><br></p><p></p>','','N'),(6,3,'<b><span style=\"color: rgb(156, 0, 255);\"><span style=\"font-size:9.5pt;\nline-height:115%\"><span style=\"font-family: Arial;\">What is a gender identity?</span></span></span><span style=\"font-size:9.5pt;\nline-height:115%\"><o:p></o:p></span></b><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\"><b><span style=\"font-size:9.5pt\">Is\na person’s</span></b></span><b><span style=\"font-size:9.5pt;mso-fareast-font-family:\" times=\"\" new=\"\" roman\";mso-bidi-font-family:=\"\" calibri;mso-bidi-theme-font:minor-latin;color:#333333;border:none=\"\" windowtext=\"\" 1.0pt;=\"\" mso-border-alt:none=\"\" 0in;padding:0in\"=\"\"><span style=\"color: rgb(0, 0, 0);\"> internal sense of being male\nor female. A person’s gender identity might coincide with their biological sex\nor differ from it.  </span>  <o:p></o:p></span></b></p><ul><li style=\"line-height: 2;\"><!--[if !supportLists]--><span style=\"font-size:9.5pt;font-family:Symbol;mso-fareast-font-family:Symbol;\nmso-bidi-font-family:Symbol;color:#333333;border:none windowtext 1.0pt;\nmso-border-alt:none windowtext 0in;padding:0in\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"><span style=\"color: rgb(156, 0, 255);\"><span style=\"font-weight: bold;\">\n</span></span></span></span><!--[endif]--><span style=\"color: rgb(156, 0, 255);\"><span style=\"font-weight: bold;\"><span style=\"font-size:9.5pt;mso-fareast-font-family:\" times=\"\" new=\"\" roman\";mso-bidi-font-family:=\"\" calibri;mso-bidi-theme-font:minor-latin;color:#333333;border:none=\"\" windowtext=\"\" 1.0pt;=\"\" mso-border-alt:none=\"\" 0in;padding:0in\"=\"\">Transgender (male-to-female or\nfemale-to-male):</span></span></span><span style=\"font-size:9.5pt;mso-fareast-font-family:\n\" times=\"\" new=\"\" roman\";mso-bidi-font-family:calibri;mso-bidi-theme-font:minor-latin;=\"\" color:#333333;border:none=\"\" windowtext=\"\" 1.0pt;mso-border-alt:none=\"\" 0in;=\"\" padding:0in\"=\"\"> <span style=\"color: rgb(0, 0, 0);\">A person whose gender identity (internal sense of being male or\nfemale) or gender expression (way of signaling gender identity through\nclothing, behaviour or communication) differs from that usually associated with\ntheir birth sex. A Transgender person identifies emotionally different than the\nsexual organ being born with. <br></span></span></li></ul><ul><li style=\"line-height: 2;\"><!--[if !supportLists]--><span style=\"font-size:9.5pt;font-family:Symbol;mso-fareast-font-family:Symbol;\nmso-bidi-font-family:Symbol;border:none windowtext 1.0pt;mso-border-alt:none windowtext 0in;\npadding:0in\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"><span style=\"color: rgb(156, 0, 255);\"><span style=\"font-weight: bold;\">\n</span></span></span></span><!--[endif]--><b><span style=\"font-size:9.5pt;mso-fareast-font-family:\" times=\"\" new=\"\" roman\";mso-bidi-font-family:=\"\" calibri;mso-bidi-theme-font:minor-latin;border:none=\"\" windowtext=\"\" 1.0pt;=\"\" mso-border-alt:none=\"\" 0in;padding:0in\"=\"\"><span style=\"color: rgb(156, 0, 255);\">Transsexual:</span><span style=\"color: rgb(0, 0, 0);\"> </span></span></b><span style=\"font-size:9.5pt;mso-fareast-font-family:\" times=\"\" new=\"\" roman\";mso-bidi-font-family:=\"\" calibri;mso-bidi-theme-font:minor-latin;border:none=\"\" windowtext=\"\" 1.0pt;=\"\" mso-border-alt:none=\"\" 0in;padding:0in\"=\"\"><span style=\"color: rgb(0, 0, 0);\">A person who wants to identify\nas or live as a member of the sex opposite to the sex that they are born\nwith. <br></span></span></li></ul><span style=\"font-size:9.5pt;mso-fareast-font-family:\" times=\"\" new=\"\" roman\";mso-bidi-font-family:=\"\" calibri;mso-bidi-theme-font:minor-latin;border:none=\"\" windowtext=\"\" 1.0pt;=\"\" mso-border-alt:none=\"\" 0in;padding:0in\"=\"\"><span style=\"color: rgb(0, 0, 0);\"></span></span><span style=\"font-size:9.5pt;mso-fareast-font-family:\" times=\"\" new=\"\" roman\";mso-bidi-font-family:=\"\" calibri;mso-bidi-theme-font:minor-latin;border:none=\"\" windowtext=\"\" 1.0pt;=\"\" mso-border-alt:none=\"\" 0in;padding:0in\"=\"\"><b><o:p></o:p></b></span><ul><li style=\"line-height: 2;\"><!--[if !supportLists]--><span style=\"font-size:9.5pt;font-family:Symbol;mso-fareast-font-family:Symbol;\nmso-bidi-font-family:Symbol;border:none windowtext 1.0pt;mso-border-alt:none windowtext 0in;\npadding:0in\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"><span style=\"color: rgb(156, 0, 255);\">\n</span></span></span><!--[endif]--><b><span style=\"font-size:9.5pt;mso-fareast-font-family:\" times=\"\" new=\"\" roman\";mso-bidi-font-family:=\"\" calibri;mso-bidi-theme-font:minor-latin;border:none=\"\" windowtext=\"\" 1.0pt;=\"\" mso-border-alt:none=\"\" 0in;padding:0in\"=\"\"><span style=\"color: rgb(156, 0, 255);\">Transvestite:</span><span style=\"color: rgb(0, 0, 0);\"> </span></span></b><span style=\"font-size:9.5pt;mso-fareast-font-family:\" times=\"\" new=\"\" roman\";mso-bidi-font-family:=\"\" calibri;mso-bidi-theme-font:minor-latin;border:none=\"\" windowtext=\"\" 1.0pt;=\"\" mso-border-alt:none=\"\" 0in;padding:0in\"=\"\"><span style=\"color: rgb(0, 0, 0);\">A person<b> </b>who derives sexual pleasure by wearing clothes usually worn by the\nopposite gender but is a heterosexual. <br></span></span></li></ul><ul><li style=\"line-height: 2;\"><!--[if !supportLists]--><span style=\"font-size:9.5pt;font-family:Symbol;mso-fareast-font-family:Symbol;\nmso-bidi-font-family:Symbol;color:#333333;border:none windowtext 1.0pt;\nmso-border-alt:none windowtext 0in;padding:0in\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"><span style=\"color: rgb(156, 0, 255);\">\n</span></span></span><!--[endif]--><b><span style=\"font-size:9.5pt;mso-fareast-font-family:\" times=\"\" new=\"\" roman\";mso-bidi-font-family:=\"\" calibri;mso-bidi-theme-font:minor-latin;color:#333333;border:none=\"\" windowtext=\"\" 1.0pt;=\"\" mso-border-alt:none=\"\" 0in;padding:0in\"=\"\"><span style=\"color: rgb(156, 0, 255);\">Hijra:</span> </span></b><span style=\"font-size:9.5pt;mso-fareast-font-family:\" times=\"\" new=\"\" roman\";mso-bidi-font-family:=\"\" calibri;mso-bidi-theme-font:minor-latin;color:#333333;border:none=\"\" windowtext=\"\" 1.0pt;=\"\" mso-border-alt:none=\"\" 0in;padding:0in\"=\"\"><span style=\"color: rgb(0, 0, 0);\">Hijra is a community of male to\nfemale transgender individuals who stay together, usually in a <i>Dera, </i>in India and follows strict rules\nand customs by guru  <br></span></span></li></ul><ul><li style=\"line-height: 2;\"><!--[if !supportLists]--><span style=\"font-size:9.5pt;font-family:Symbol;mso-fareast-font-family:Symbol;\nmso-bidi-font-family:Symbol;border:none windowtext 1.0pt;mso-border-alt:none windowtext 0in;\npadding:0in\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"><span style=\"color: rgb(156, 0, 255);\">\n</span></span></span><!--[endif]--><b><span style=\"font-size:9.5pt;mso-fareast-font-family:\" times=\"\" new=\"\" roman\";mso-bidi-font-family:=\"\" calibri;mso-bidi-theme-font:minor-latin;border:none=\"\" windowtext=\"\" 1.0pt;=\"\" mso-border-alt:none=\"\" 0in;padding:0in\"=\"\"><span style=\"color: rgb(156, 0, 255);\">Kothi:</span> </span></b><span style=\"font-size:9.5pt;mso-fareast-font-family:\" times=\"\" new=\"\" roman\";mso-bidi-font-family:=\"\" calibri;mso-bidi-theme-font:minor-latin;border:none=\"\" windowtext=\"\" 1.0pt;=\"\" mso-border-alt:none=\"\" 0in;padding:0in\"=\"\"><span style=\"color: rgb(0, 0, 0);\">A male individual but relates\nmore with the female role in a sexual and emotional relationship between two\nconsenting young people. Mostly they are receptive partners.</span></span></li></ul><ul><li style=\"line-height: 2;\"><!--[if !supportLists]--><span style=\"font-size:9.5pt;font-family:Symbol;mso-fareast-font-family:Symbol;\nmso-bidi-font-family:Symbol;border:none windowtext 1.0pt;mso-border-alt:none windowtext 0in;\npadding:0in\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"><span style=\"color: rgb(156, 0, 255);\"></span></span></span><!--[endif]--><span style=\"color: rgb(156, 0, 255);\"><b><span style=\"font-size:9.5pt;mso-fareast-font-family:\" times=\"\" new=\"\" roman\";mso-bidi-font-family:=\"\" calibri;mso-bidi-theme-font:minor-latin;border:none=\"\" windowtext=\"\" 1.0pt;=\"\" mso-border-alt:none=\"\" 0in;padding:0in\"=\"\">Panthis/Giriya/Parikh</span></b></span><span style=\"font-size:9.5pt;mso-fareast-font-family:\" times=\"\" new=\"\" roman\";mso-bidi-font-family:=\"\" calibri;mso-bidi-theme-font:minor-latin;border:none=\"\" windowtext=\"\" 1.0pt;=\"\" mso-border-alt:none=\"\" 0in;padding:0in\"=\"\"><span style=\"color: rgb(156, 0, 255);\">:</span> <span style=\"color: rgb(0, 0, 0);\">A person who is a sexual\npartner of “Kothi” and takes the “masculine” role. Usually a penetrative\npartner</span></span>·<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">        </span></li><li style=\"line-height: 2;\"><span style=\"background-color: rgb(255, 255, 255);\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"></span><b style=\"text-align: justify; text-indent: -0.25in; color: inherit;\"><span style=\"font-size: 9.5pt; border: 1pt none windowtext; padding: 0in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"color: rgb(156, 0, 255);\">Double decker:</span> </span></b><span style=\"color: rgb(0, 0, 0);\"><span style=\"text-align: justify; text-indent: -0.25in; font-size: 9.5pt; border: 1pt none windowtext; padding: 0in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">A person</span><span class=\"MsoCommentReference\" style=\"text-align: justify; text-indent: -0.25in;\"><span style=\"font-size:8.0pt\"><a class=\"msocomanchor\" id=\"_anchor_1\" href=\"file:///C:/Users/codecube/Downloads/Bulleted%20content%20for%20English%20App%20-%2015%20March-for%20rechange.docx#_msocom_1\" language=\"JavaScript\" name=\"_msoanchor_1\"></a></span></span><b style=\"text-align: justify; text-indent: -0.25in;\"><span style=\"font-size: 9.5pt; border: 1pt none windowtext; padding: 0in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"> </span></b><span style=\"text-align: justify; text-indent: -0.25in; font-size: 9.5pt; border: 1pt none windowtext; padding: 0in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">who is\nboth a receptor and penetrator in sexual relations with males.</span></span></span></li></ul><p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n</p>','','<p><span style=\"color: rgb(156, 0, 255); font-weight: bold;\">लिंग पहचानः</span></p><p style=\"line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-weight: bold;\">ये व्यक्ति के पुरुष, स्त्री  या कुछ और होने के आतंरिक भावना को कहते है. हमारा लिंग पहचान हमारे जैविक सेक्स के सामान भी हो सकता है और अलग भी।</span></span></p><ul><li style=\"line-height: 2;\"><span style=\"color: rgb(156, 0, 255); font-weight: bold;\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>ट्रांसजेंडर (स्त्री-से-पुरुष या पुरुष-से-स्त्री):</span><span style=\"color: rgb(156, 0, 255);\"><span style=\"color: rgb(0, 0, 0);\"> ट्रांसजेंडर वो व्यक्ति होता है जिसकी स्त्री या पुरुष होने की आतंरिक भावना या लिंग अभिव्यक्ति (अपने कपडे, व्यवहार या संचार से लिंग पहचान का संकेत करना) उनके जन्म सेक्स से अलग होता है। ट्रांसजेंडर व्यक्ति अपने आप को भावनात्मक रूप से अपने यौनांग, जिसमे वो पैदा होते है, से अलग मानते है।</span></span></li></ul><ul><li style=\"line-height: 2;\"><span style=\"color: rgb(156, 0, 255); font-weight: bold;\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>ट्रान्स सेक्सुअलः</span><span style=\"color: rgb(156, 0, 255);\"><span style=\"color: rgb(0, 0, 0);\"> ये वो व्यक्ति होते है जो खुद की पहचान अपने लिंग जिसमे वो पैदा हुए है उससे अलग करना चाहते है और उसको जीना चाहते है।</span></span></li></ul><ul><li style=\"line-height: 2;\"><span style=\"color: rgb(156, 0, 255); font-weight: bold;\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>भिन्न लिंग वेश धारण करने वाले व्यक्ति: </span><span style=\"color: rgb(156, 0, 255);\"><span style=\"color: rgb(0, 0, 0);\">ये विषम लैंगिक व्यक्ति होते है परंतु इनके कपडे पहनने का ढंग उनके लिंग से अलग होता है.</span></span></li></ul><ul><li style=\"line-height: 2;\"><span style=\"color: rgb(156, 0, 255); font-weight: bold;\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>हिजड़ा: </span><span style=\"color: rgb(0, 0, 0);\">हिजड़ा वो समुदाय होता है जो एक साथ रहता है, आमतौर में डेरा में और अपने गुरु के सख्त नियम और रिवाजों का पालन करते है।</span></li></ul><span style=\"color: rgb(156, 0, 255); font-weight: bold;\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span></span><ul><li><span style=\"color: rgb(156, 0, 255); font-weight: bold;\">कोती:</span><span style=\"color: rgb(156, 0, 255);\"><span style=\"color: rgb(0, 0, 0);\"> वह पुरुष जो अधिकतर भावनात्मक और यौनिक रूप से अपने आप को पुरुष लिंग होने के पश्चात महिला मानते है। अक्सर यह आपसी सहमति से सम्बन्ध बनाता है। कोती अक्सर यौन संबंधों में रिसेप्टिव भूमिका निभाते है।</span></span></li></ul><ul><li style=\"line-height: 2;\"><span style=\"color: rgb(156, 0, 255); font-weight: bold;\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>पंथी/गिरिया/पारीक: </span><span style=\"color: rgb(156, 0, 255);\"><span style=\"color: rgb(0, 0, 0);\">यह वह होते है जो ‘कोती‘ के पार्टनर या साथी होते है और यह सम्बन्ध में मर्दाना व्यव्हार रखते है। संबंधों के दौरान यह प्रवेशक करने का यानि पेनिट्रेटिव भूमिका निभाते है।  <br></span></span></li></ul><ul><li style=\"line-height: 2;\"><span style=\"color: rgb(156, 0, 255); font-weight: bold;\">गेः</span><span style=\"color: rgb(156, 0, 255);\"><span style=\"color: rgb(0, 0, 0);\"> ये अपने को समलैंगिक मानते है।</span></span></li></ul><ul><li style=\"line-height: 2;\"><span style=\"color: rgb(156, 0, 255); font-weight: bold;\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>द्विलिंगीः </span><span style=\"color: rgb(156, 0, 255);\"><span style=\"color: rgb(0, 0, 0);\">ये लौंगिक और भावनात्मक रूप से दोनों स्त्री और पुरुष से आकर्षित होते है।</span></span></li></ul><div style=\"line-height: 2;\"><br></div><div><br></div>','','N'),(9,6,'\n\n\n	\n	\n	\n	\n\n\n\n\n\n\n','','<p>à¤¯à¥‡ à¤œà¤¾à¤¨à¤¨à¤¾ à¤¬à¤¹à¥à¤¤ à¤œà¤°à¥‚à¤°à¥€ à¤¹à¥ˆà¤‚ à¤•à¤¿ à¤šà¤¿à¤‚à¤¤à¤¾ à¤¯à¤¾ à¤‰à¤¦à¤¾à¤¸à¥€ à¤•à¥‹ à¤®à¤¹à¤¸à¥‚à¤¸ à¤•à¤°à¤¨à¤¾ à¤¬à¤¹à¥à¤¤ à¤¹à¥€ à¤†à¤® à¤¹à¥ˆà¤‚à¥¤ à¤•à¤¿à¤¸à¥€ à¤­à¥€ à¤µà¥à¤¯à¤•à¥à¤¤à¤¿ à¤•à¥‹, à¤œà¥‹ à¤‡à¤¨ à¤²à¤•à¥à¤·à¤£à¥‹à¤‚ à¤¸à¥‡ à¤—à¥à¤œà¤° à¤°à¤¹à¤¾ à¤¹à¥ˆà¤‚ à¤‰à¤¸à¤•à¥‹ à¤•à¤¿à¤¸à¥€ à¤šà¤¿à¤•à¤¿à¤¤à¥à¤¸à¤• à¤¯à¤¾ à¤¸à¤²à¤¾à¤¹à¤•à¤¾à¤° à¤¸à¥‡ à¤œà¤°à¥‚à¤° à¤¬à¤¾à¤¤ à¤•à¤°à¤¨à¥€ à¤šà¤¾à¤¹à¤¿à¤¯à¥‡à¥¤ à¤¯à¥‡ à¤†à¤ªà¤•à¥‹ à¤‡à¤¨ à¤²à¤•à¥à¤·à¤£à¥‹à¤‚ à¤¸à¥‡ à¤‰à¤­à¤°à¤¨à¥‡ à¤®à¥‡à¤‚ à¤®à¤¦à¤¦ à¤•à¤°à¤‚à¥‡à¤—à¥‡ à¤”à¤° à¤†à¤ªà¤•à¥‹ à¤—à¥à¤£à¤µà¤¤à¤¾à¤ªà¥‚à¤°à¥à