\"><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><span style=\"color: rgb(0, 0, 0);\">STI stands for Sexually Transmitted\nInfection, refers to infections transmitted through sexual contact. STIs are\ndangerous as it increases the risk of getting an HIV infection 4 times in a\nperson. </span><o:p></o:p></span></p><p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left: 0.25in; text-align: justify; text-indent: -0.25in; line-height: 2;\"><span style=\"font-size:10.0pt;\nline-height:115%;mso-fareast-font-family:Calibri;mso-bidi-font-family:Calibri;\nmso-bidi-theme-font:minor-latin;mso-ansi-language:EN-IN\" lang=\"EN-IN\"><span style=\"color: rgb(0, 0, 0);\">Some of the common\nSTIs are </span><br></span></p><ul><li><!--[if !supportLists]--><span style=\"font-size:10.0pt;line-height:115%;font-family:\" courier=\"\" new\";=\"\" mso-fareast-font-family:\"courier=\"\" new\";mso-ansi-language:en-in\"=\"\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">\n</span></span><!--[endif]--><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size:10.0pt;\nline-height:115%;mso-fareast-font-family:Calibri;mso-bidi-font-family:Calibri;\nmso-bidi-theme-font:minor-latin;mso-ansi-language:EN-IN\" lang=\"EN-IN\">Gonorrhoea</span></span></li></ul><ul><li><!--[if !supportLists]--><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size:10.0pt;\nline-height:115%;mso-fareast-font-family:Calibri;mso-bidi-font-family:Calibri;\nmso-bidi-theme-font:minor-latin;mso-ansi-language:EN-IN\" lang=\"EN-IN\">Syphilis</span></span></li></ul><ul><li><!--[if !supportLists]--><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size:10.0pt;line-height:115%;font-family:\" courier=\"\" new\";=\"\" mso-fareast-font-family:\"courier=\"\" new\";mso-ansi-language:en-in\"=\"\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">\n</span></span><span style=\"font-size:10.0pt;\nline-height:115%;mso-fareast-font-family:Calibri;mso-bidi-font-family:Calibri;\nmso-bidi-theme-font:minor-latin;mso-ansi-language:EN-IN\" lang=\"EN-IN\">Chlamydia</span></span><!--[endif]--></li></ul><ul><li><!--[if !supportLists]--><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size:10.0pt;\nline-height:115%;mso-fareast-font-family:Calibri;mso-bidi-font-family:Calibri;\nmso-bidi-theme-font:minor-latin;mso-ansi-language:EN-IN\" lang=\"EN-IN\">HIV/AIDS</span></span></li></ul><ul><li><!--[if !supportLists]--><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size:10.0pt;line-height:115%;font-family:\" courier=\"\" new\";=\"\" mso-fareast-font-family:\"courier=\"\" new\";mso-ansi-language:en-in\"=\"\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"></span></span><span style=\"font-size:10.0pt;\nline-height:115%;mso-fareast-font-family:Calibri;mso-bidi-font-family:Calibri;\nmso-bidi-theme-font:minor-latin;mso-ansi-language:EN-IN\" lang=\"EN-IN\">Genital herpes</span></span><!--[endif]--></li></ul><ul><li><!--[if !supportLists]--><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size:10.0pt;line-height:115%;font-family:\" courier=\"\" new\";=\"\" mso-fareast-font-family:\"courier=\"\" new\";mso-ansi-language:en-in\"=\"\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"></span></span><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Hepatitis\nand <br></span></span><!--[endif]--></li></ul><ul><li><!--[if !supportLists]--><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size:10.0pt;line-height:115%;font-family:\" courier=\"\" new\";=\"\" mso-fareast-font-family:\"courier=\"\" new\";mso-ansi-language:en-in\"=\"\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">\n</span></span><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Genital\nwarts</span></span><!--[endif]--></li></ul><p class=\"MsoListParagraphCxSpLast\" style=\"text-align: justify; text-indent: -0.25in; line-height: 2;\"><span style=\"color: rgb(156, 0, 255);\"><br><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: 2;\"><span style=\"color: rgb(156, 0, 255);\"><b><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">A few common symptoms of STIs are:</span></b></span></p><ul><li><!--[if !supportLists]--><span style=\"font-size:10.0pt;font-family:Symbol;mso-fareast-font-family:\nSymbol;mso-bidi-font-family:Symbol;mso-ansi-language:EN-