color: rgb(0, 0, 0);\"><span style=\"font-family: Arial;\">एच.आई.वी से संक्रमित होने के बाद व्यक्ति में प्राथमिक संक्रमण के रूप में फ्लू जैसे लक्षण नजर आते है जैसे -</span></span></p><ul><li><span style=\"color: rgb(156, 0, 255); font-family: Arial; font-weight: bold;\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span></span><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial;\">बुखार</span></span></li></ul><ul><li><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial;\">मासपेशियो में दर्द <br></span></span></li></ul><ul><li><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial;\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>लाल चकते <br></span></span></li></ul><ul><li><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial;\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>सर में दर्द और लिंग में सूजन</span></span></li></ul><ul><li><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial;\">एड्स अपने आप में कोई बीमारी न होकर एच.आई.वी संक्रमण की वजह से होने वाली कई बीमारियों के लक्षणों को दिखाती है। <br></span></span></li></ul><ul><li><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial;\">जब किसी एच.आई.वी. संक्रमित व्यक्ति का सी.डी. 4 काउंट 500 से नीेचे चला जाता है तब उसे एड्स से ग्रसित कहा जाता है।</span></span></li></ul><ul><li><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial;\">एड्स या अंतिम श्रेणी के लक्षण (इस श्रेणी में शरीर पूर्णतः हर प्रकार के संक्रमण लेता है) नीचे दिये गए है।</span></span></li></ul><ul><li><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial;\">अत्यधिक थकावट <br></span></span></li></ul><ul><li><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial;\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>तेजी से वजन कम होना</span></span></li></ul><ul><li><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial;\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>ठण्ड लगना और बुखार आना <br></span></span></li></ul><ul><li><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial;\">मुह और जननांग में छाले आना <br></span></span></li></ul><ul><li><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial;\">अत्यधिक सर में दर्द</span></span></li></ul><p class=\"MsoNormal\" style=\"margin-bottom: 3pt; text-align: justify; line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial;\"></span></span><span style=\"color: rgb(156, 0, 255); font-family: Arial; font-weight: bold;\"><br></span></p>','','N'),(15,5,'<h3 class=\"MsoNormal\" style=\"   margin-bottom:6.0pt\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-weight: bold;\"><span style=\"color: rgb(156, 0, 255);\"><span style=\"background-color: rgb(255, 255, 255);\"><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Genital herpes:</span></span></span><span style=\"font-family:\" mangal\",\"serif\";mso-bidi-font-family:mangal;mso-bidi-theme-font:=\"\" minor-bidi;mso-bidi-language:hi\"=\"\" lang=\"EN-IN\"> </span></span><span style=\"font-family:\" mangal\",\"serif\";mso-bidi-font-family:mangal;mso-bidi-theme-font:=\"\" minor-bidi;mso-bidi-language:hi\"=\"\" lang=\"EN-IN\"></span><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><span style=\"font-weight: normal;\">Genital herpes is spread through sexual contact. The herpes that is\nspread sexually is generally called “herpes zoster”. </span><o:p></o:p></span>