al; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><span style=\"font-weight: normal;\">In\nmen, lesions (an injured or diseased spot or area on or in the body) usually\nappear on the penis, scrotum (the sack of skin hanging below the penis that\ncontains the testicles), buttocks and inner thighs</span><o:p></o:p></span></span></span></h3></li></ul><h3 class=\"MsoListParagraphCxSpMiddle\" style=\"   margin-left:22.5pt;mso-add-space:\nauto;text-align:justify;text-justify:inter-ideograph;text-indent:-13.5pt;\nmso-list:l0 level2 lfo1\"><!--[endif]--></h3><h3>\n\n\n\n\n\n\n\n\n\n</h3><h3 class=\"MsoListParagraphCxSpLast\" style=\"   margin-left:22.5pt;mso-add-space:auto;\ntext-align:justify;text-justify:inter-ideograph;text-indent:-13.5pt;mso-list:\nl0 level2 lfo1\"><!--[if !supportLists]--></h3><ul><li><h3><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-weight: normal;\"><span style=\"font-size: 10pt; line-height: 115%;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"> </span></span></span><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><span style=\"font-weight: normal;\">Fever, painful urination and swollen\nlymph nodes</span><o:p></o:p></span></span></span></h3></li></ul><p class=\"MsoListParagraphCxSpLast\" style=\"margin-left:22.5pt;mso-add-space:auto;\ntext-align:justify;text-justify:inter-ideograph;text-indent:-13.5pt;mso-list:\nl0 level2 lfo1\"><!--[endif]--></p>','','<h5 class=\"MsoListParagraphCxSpFirst\" style=\"text-align: justify; text-indent: -0.25in; line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(156, 0, 255); font-weight: bold;\">     </span><span style=\"color: rgb(156, 0, 255); font-weight: bold;\">जननांग में दाद या खाजः</span><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-weight: normal;\"> असुरक्षित संभोग से फैलता है और इसको ‘‘हर्पीस जोस्टर‘‘ भी कहते है। ज्यादातर लोग इसके लक्षणों को देख नहीं पाते है पर जो व्यक्ति इन्हें महसूस करते है वो निन्म लक्षण हैः <br></span></span></span></h5><ul><li style=\"line-height: 2;\"><h5 class=\"MsoListParagraphCxSpFirst\" style=\"text-align: justify; text-indent: -0.25in; line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(156, 0, 255); font-weight: bold;\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span></span><span style=\"font-weight: normal;\"><span style=\"color: rgb(156, 0, 255);\"><span style=\"color: rgb(0, 0, 0);\">        समय-समय पर जननांग में दर्द सहित घाव होना</span></span></span></span></h5></li></ul><ul><li style=\"line-height: 2;\"><h5 class=\"MsoListParagraphCxSpFirst\" style=\"text-align: justify; text-indent: -0.25in; line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>       <span style=\"font-weight: normal;\"> जननांग में छाले</span> <span style=\"font-weight: normal;\">या अलसर होना</span></span></span></h5></li></ul><ul><li style=\"line-height: 2;\"><h5 class=\"MsoListParagraphCxSpFirst\" style=\"text-align: justify; text-indent: -0.25in; line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>       <span style=\"font-weight: normal;\"> पुरुषो में ये ज्यादातर उनके लिंग में, जांघों के बीच में या नितम्ब में घाव के रूप्  में होता है </span><br></span></span></h5></li></ul><ul><li style=\"line-height: 2;\"><h5 class=\"MsoListParagraphCxSpFirst\" style=\"text-align: justify; text-indent: -0.25in; line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">       <span style=\"font-weight: normal;\"> बुखार होना, मूत्रत्याग के समय दर्द होना, लिंफ नोडस मेें सूजन</span></span></span></h5></li></ul><p><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><br></span></span></p><div style=\"text-align: justify; text-indent: -24px;\"><span style=\"font-family: Arial Black;\"><br></span></div>','','N'),(16,5,'<p class=\"MsoNormal\" style=\"margin-bottom:2.0pt;text-align:justify;text-justify:\ninter-ideograph\"><span style=\"font-family: Arial Black;\"><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"color: rgb(156, 0, 255);\"><span style=\"font-weight: bold;\">Viral Hepatitis: </span></span>This is\nan infection of the liver. Hepatitis is often symptomless; many infected people\nmay discover Hepatitis only when they start having a liver problem. <br></span></span></span></p><p class=\"MsoNormal\" style=\"margin-bottom:2.0pt;text-align:justify;text-justify:\ninter-ideograph\"><span style=\"font-family: Arial Black;\"><br><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><span style=\"color: rgb(0, 0, 0);\"><o:p></o:p></span></span></span></p><p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left:22.5pt;mso-add-space:\nauto;text-align:justify;text-justify:inter-ideograph;text-indent:-13.5pt;\nmso-list:l0 level2 lfo1\"><!--[if !supportLists]--></p><ul><li><span style=\"font-family: Arial Black;\"><span st