, 0, 0);\"><span style=\" font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"></span></span></span><ul><li style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><a style=\"text-align: justify; text-indent: -13.5pt; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 10pt; line-height: 115%;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"></span></span><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"></span></a><span style=\"color: rgb(0, 0, 0);\">Joint pain<br></span></span></li></ul><span style=\"font-family: Arial Black;\"><span style=\" color: rgb(0, 0, 0);\"></span></span><ul><li style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"></span><span style=\"text-align: justify; text-indent: -13.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 10pt; line-height: 115%;\" lang=\"EN-IN\">Dark\nurine</span></span></span></li></ul><span style=\"font-family: Arial Black;\"><span style=\" color: rgb(0, 0, 0);\"><span style=\" text-align: justify; text-indent: -13.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 10pt; line-height: 115%;\" lang=\"EN-IN\"></span></span></span><ul><li style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"> </span><span style=\"text-align: justify; text-indent: -13.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 10pt; line-height: 115%;\" lang=\"EN-IN\">Jaundice</span></span></span></li></ul><span style=\"font-family: Arial Black;\"><span style=\" color: rgb(0, 0, 0);\"><span style=\" text-align: justify; text-indent: -13.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 10pt; line-height: 115%;\" lang=\"EN-IN\"></span></span></span><ul><li style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">  </span><span style=\"text-align: justify; text-indent: -13.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 10pt; line-height: 115%;\" lang=\"EN-IN\">Stomach\npain</span></span></span>\n\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin: 0in 0in 3pt 40.5pt; text-align: justify; text-indent: -0.25in; line-height: 2;\"><!--[if !supportLists]--><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size:10.0pt;line-height:115%;font-family:\" courier=\"\" new\";mso-fareast-font-family:=\"\" \"courier=\"\" new\";mso-ansi-language:en-in\"=\"\" lang=\"EN-IN\">o<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">    </span></span><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Hepatitis B & C can be\ntransmitted through various sources but it can also be transmitted through\nunsafe sexual contacts that involve direct contact between mouth and the anus\n(like rimming and stimulation of the anus with finger or toys).<o:p></o:p></span></span></span><!--[endif]--></p>\n\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin: 0in 0in 3pt 40.5pt; text-align: justify; text-indent: -0.25in; line-height: 2;\"><!--[if !supportLists]--><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size:10.0pt;line-height:115%;font-family:\" courier=\"\" new\";mso-fareast-font-family:=\"\" \"courier=\"\" new\";mso-ansi-language:en-in\"=\"\" lang=\"EN-IN\">o<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">    </span></span><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">It is also transmitted through\nsharing infected needles, razors or other items that can allow transmission of\ninfected blood. <o:p></o:p></span></span></span><!--[endif]--></p>\n\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin: 0in 0in 3pt 40.5pt; text-align: justify; text-indent: -0.25in; line-height: 2;\"><!--[if !supportLists]--><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size:9.5pt;mso-bidi-font-size:8.5pt;line-height:115%;font-family:\n\" courier=\"\" new\";mso-fareast-font-family:\"courier=\"\" new\";mso-ansi-language:en-in;=\"\" mso-bidi-language:hi\"=\"\" lang=\"EN-IN\">o<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">   \n</span></span><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">The</span><span style=\"font-size: 9.5pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"> most\neffective way to prevent hepatitis B is to get the vaccine. No vaccine is\navailable for hepatitis C.</span></span></span><!--[endif]--></p>\n\n<div style=\"line-height: 2;\"><!--[if !supportAnnotations]-->\n\n<hr class=\"msocomoff\" width=\"33%\" size=\"1\" align=\"left\">\n\n<!--[endif]-->\n\n<div style=\"line-height: 2;\"><!--[if !supportAnnotations]-->\n\n<div id=\"_com_1\" class=\"msocomtxt\" language=\"JavaScript\" style=\"line-height: 2;\"><!--[endif]--><!--[if !supportAnnotations]--><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><a name=\"_msocom_1\"></a></span></span><!--[endif]-->\n\n<p class=\"MsoCommentText\" style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><br></span></span></p></div></div></div></li></ul><span style=\"font-family: Arial Black;\"><br></span>','','<h5 style=\"line-height: 2;\"><span style=\"color: rgb(156, 0, 255);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span><span style=\"font-family: Arial Black;\"><span style=\"font-weight: bold;\"><span style=\"font-weight: normal;\">हेपेटाइटिसः</span></span></span></span></h5><h5 style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"font-weight: normal;\"><span style=\"color: rgb(0, 0, 0);\">यह संक्रमण लिवर में होता हैं। यह ज्यादातर लक्षणों के बिना होता हैं।</span></span></span></h5><ul><li><h5 style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"> <span style=\"font-weight: normal;\">हेपेटाइटिस 5 प्रकार के होते हैं जिसमे से ‘हेपेटाइटिस-बी‘ और ‘हेपेटाइटिस-सी‘ असुरक्षित सम्भोग करने से हो सकते हैं। यह संक्रमित रक्त, संक्रमित सुइयों या उस्तरों के सांझे प्रयोग से भी हो सकता हैं। इसके लक्षण नीचे दिए हुए हैं:</span></span></span></h5></li></ul><ul><li><h5 style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-weight: normal;\"><span id=\"result_box\" class=\"short_text\" lang=\"hi\"><span class=\"\">बुखार</span></span> आना</span></span></span></h5></li></ul><ul><li><h5 style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span><span style=\"font-weight: normal;\">हमेशा थकान महसूस करना</span></span></span></h5></li></ul><ul><li><h5 style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span><span style=\"font-weight: normal;\">जी मिचलाना</span></span></span></h5></li></ul><ul><li><h5 style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span><span style=\"font-weight: normal;\">भूख ना लगना </span></span></span></h5></li></ul><ul><li><h5 style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-weight: normal;\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>जोड़ो में दर्द होना</span></span></span></h5></li></ul><ul><li><h5 style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span><span style=\"font-weight: normal;\">गाढ़ा रंग का मूत्र आना</span></span></span></h5></li></ul><ul><li><h5 style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span><span style=\"font-weight: normal;\">पीलिया</span></span></span></h5></li></ul><ul><li><h5 style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-weight: normal;\">पेट में</span> <span style=\"font-weight: normal;\">अत्यधिक दर्द</span></span></span></h5></li></ul><div style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">‘हेपेटाइटिस बी और सी‘ कई सूत्रों से फैलता हैं परंतु ये ज्यादातर असुरक्षित सम्भोग से होता हैं जिसमे मुख और गूदे (जैसे उंगलियो या खिलौनों से गुदा लेहन करना) का सीधा संपर्क होता हैं। ‘हेपेटाइटिस बी‘ के प्रभाव से बचने के लिए टीके का उपयोग किया जाता है। ‘हेपेटाइटिस सी‘ के लिए कोई टीका उपलब्ध नहीं हैं </span></span><br></div>','','N'),(17,5,'<h4 class=\"MsoListParagraphCxSpFirst\" style=\" margin-left: 22.5pt; text-align: justify; text-indent: -13.5pt; line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"font-size: 9.5pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><span style=\"font-weight: bold;\"><span style=\"font-weight: normal;\"><span style=\"color: rgb(156, 0, 255);\"><span style=\"font-weight: bold;\">Genital warts:</span> </span></span></span><o:p></o:p></span><span style=\"font-size: 10pt; line-height: 115%;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"></span></span></span></h4><ul><li style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; line-height: 115%;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"> </span></span><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Growths\nor bumps that can appear on the penis, rectum (a tube like structure, just\nbefore the anus), scrotum. These are passed from an infected person to another\nperson through unprotected sex.</span></span></span></li></ul><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\" font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"></span></span></span><h4 class=\"MsoListParagraphCxSpFirst\" style=\" margin-left: 22.5pt; text-align: justify; text-indent: -13.5pt; line-height: 2;\"><!--[endif]--></h4><h4 class=\"MsoListParagraphCxSpMiddle\" style=\" margin-left: 22.5pt; text-align: justify; text-indent: -13.5pt; line-height: 2;\"><!--[if !supportLists]--></h4><ul><li style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; line-height: 115%;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"></span></span><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Skin\nto skin contact as well as penetration can lead to its spread. <br></span></span></span></li></ul><span style=\"font-family: Arial Black;\"><span style=\" color: rgb(0, 0, 0);\"><span style=\" font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"></span></span></span><h4 class=\"MsoListParagraphCxSpMiddle\" style=\" margin-left: 22.5pt; text-align: justify; text-indent: -13.5pt; line-height: 2;\"><!--[endif]--></h4><h4 style=\" line-height: 2;\">\n\n\n\n\n\n</h4><ul><li style=\"line-height: 2;\"><h5 class=\"MsoListParagraphCxSpLast\" style=\"  margin-left: 22.5pt; text-align: justify; text-indent: -13.5pt; line-height: 2;\"><!--[if !supportLists]--><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 9.5pt; line-height: 115%;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"></span></span><span style=\"font-weight: normal;\"><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">The</span></span></span></span><!--[endif]--><span style=\"font-size: 9.5pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><span style=\"font-family: Arial Black;\"><span style=\"font-weight: normal;\"><span style=\"color: rgb(0, 0, 0);\"> only way to reduce the risk of getting infected with\nGenital warts is to follow safer sexual practices and consistent use of condom\nat each sex.</span></span></span><o:p></o:p></span></h5></li></ul>','','<h5 style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(156, 0, 255);\">जननांग में गाँठ या मस्साः <br></span></span></h5><ul><li><h5 style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-weight: normal;\">ये लिंग, गूदे या अंडकोश (टेस्टीफ्लस) में किसी फोड़े या उभर की तरह होता हैं। <br></span></span></span></h5></li></ul><span style=\"font-family: Arial Black;\"><span style=\"font-weight: bold;\"></span></span><ul><li><h5 style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-weight: normal;\">यह असुरक्षित सम्भोग के द्वारा किसी संक्रमित व्यक्ति से दूसरे व्यक्ति में फैलता हैं।</span></span></span></h5></li></ul><span style=\"font-family: Arial Black;\"><span style=\"font-weight: bold;\"><span style=\" color: rgb(0, 0, 0);\"><span style=\" font-weight: normal;\"></span></span></span></span><ul><li><h5 style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-weight: normal;\"> यह संक्रमित त्वचा के छूने से फैलता हैं। इसके खतरे से बचने के लिए सुरक्षित सम्भोग और कंडोम का उपयोग क