insert  into `tbl_message` values (3,'expert',18,0,'ish',1504,'hhhhhhhhhhhhhhhhhh','Y','2017-05-04 06:10:57','Y'),(4,'expert',22,0,'sabrang..',1,'--dfjhdjfhkshdfh','Y','2017-05-04 06:10:51','Y'),(5,'expert',22,0,'Again testing..',1,'reply experts','Y','2017-05-04 06:10:55','Y'),(6,'expert',22,0,'testing..',1,'--ndjasdjas','Y','2017-05-04 06:10:49','Y'),(7,'expert',22,0,'testing for sabrang',1,'--sabrang --------','Y','2017-05-04 06:10:45','Y'),(8,'expert',46,0,'i am atteacted toward a trans, what to do?',1,'--Okay Sumit. Way to go. You can love anybody ','Y','2017-05-03 04:39:50','N'),(9,'expert',48,0,'why should i take the hiv test',1,'--To be safe ','Y','2017-05-03 05:26:00','N'),(10,'expert',49,0,'where can I go for HIV test?',1,'--To any close by center','Y','2017-05-03 05:27:10','N'),(11,'expert',44,0,'lata is testing',NULL,NULL,NULL,'2017-05-04 11:28:26','Y'),(12,'expert',58,0,'What is STI?',1,'STI are those infections which spread through contact /exchange of body fluid during sex.','Y','2017-05-04 05:33:18','N'),(13,'expert',59,0,'hiv kya h',27,'HIV ek virus hai jo sarir mai pravesh hone par partirodhak shaktio ko kam kar deta hai. Is ke vajah se kai beemariya hone lagti hai.','Y','2017-05-04 07:33:58','N'),(14,'expert',287,0,'Is Rashes at male genitals due to heat also called as one of the symptoms of STD or STI?',1,'Usually rashes can occur on male genitals because of exposure to extreme temperatures! Rashes due to cold exposure and allergies are common. Rashes could also be\n\n\nUsually rashes can occur on male genitals because of exposure to extreme temperatures! Rash\nUsually rashes can occur on male genitals because of exposure to extreme temperatures! Rashes due to cold exposure and allergies are common. Rashes could also be Usually rashes can occur on male genitals because of exposure to extreme temperatures! Rash','Y','2017-05-08 05:37:16','Y'),(15,'expert',48,0,'does my age matter in getting hiv',26,'no','Y','2017-05-05 06:02:23','N'),(16,'expert',55,0,'dear sir/man, mai batana chahta hu ki m ek ladka hu or mujhe ladko ki sath hi sex karna pasand h. but kabi kabi mujhe apne upar bhut guilt feel hota h or m us time khud ko stright banana chahta hu iske lie m bhut baar apna whatsapp, contacts bi delete kar',27,'Dear Rahul,\nAkarshan kisi ko bhi kisi ke sath ho sakta hai. Akarshan ek “emotional and sexual “ prakriya hai jo sabhi insano mai hota hai.akarshan andurini bhavna hai , yeh badla nihi ja sakta. Samlaingik (saman yaun walo ke taraf akarsan) hona bilkul nor','Y','2017-05-06 06:17:05','N'),(17,'expert',52,0,'sumit, can you please tell if I m having syphilis then what should I do? m I more vulnerable to HIV?  and why? how did I get it? what to do now?',27,'Dear Neeraj, \nSyphilis has both symptomatic and non symptomatic phases.\nDuring the symptomatic phase, there will be a small eruption on genitalia for couple of days and then disappears on  its own. although the symptom cease to exist but the infection is ','Y','2017-05-06 06:34:51','N'),(18,'expert',79,0,'If a person who is not diagnosed with hiv aids . we can say he is in window period donates blood . at the time of donating hiv not diagnosed . afterwards the donated blood gives to a person who is not infected .',23,'There are certain protocols followed for blood donation and transfusion. The donated blood is screened for blood borne diseases including HIV before processing. And recognized labs never give the same donated blood directly to the patient. Usually the blood is processed and at times stored. The blood that is given to patient for the transfusion is processed, screened and come from storage usually. It is retested most of the times before transfusion, if the lab is authentic one! \nBut when there is shortage of blood, it can happen! The only precaution to be taken is to donate and receive blood for transfusion from authentic, licensed labs. ','Y','2017-05-09 07:33:32','N'),(19,'expert',287,0,'Any good Dermatologist for male in South Delhi near JNU??',27,'DR AMIT LUTHRA\nIshira Clinic S-341, Panchsheel Park, South Delhi, Delhi, Delhi, 110017\nPhone: 098100 62252','Y','2017-05-10 12:39:16','N'),(20,'expert',287,0,'removing pubic hair is good or bad?',23,'Removing pubic hairs is a hygeinic practice. It prevents acumulation of  dirt, sweat and secretions in groin areas (especially creases of thighs) and genitals, which prevents various fungal and bacterial infections. \nAlso it relatively protects from pubic lice infestation','Y','2017-05-10 08:07:44','N'),(21,'expert',54,0,'lata testing..',1,'sabrang','Y','2017-05-12 05:34:23','Y'),(22,'expert',101,0,'testing',NULL,NULL,NULL,'2017-05-12 05:47:08','Y'),(23,'expert',101,0,'sonam testing',NULL,NULL,NULL,'2017-05-12 05:47:03','Y'),(24,'expert',287,0,'Dr Abhishek thanks for your response. But few weeks ago I read somewhere online that pubic hair some how protect from some std during sexual contact because pubic hair prevent direct body contact between sex. Please help me on this confusion.',23,'This is indeed a very good question. Dense Pubic hairs provide a good habitat for pubic lice. As mentioned earlier, removal of pubic hairs relatively decreases the chances of pubic lice infestation. \nUsually, groin hairs are cleared by using razors or trimmers,which leads to micro cuts over skin of groin area. Also many times, hair removal creams, leads to rashes in groins. These cuts and rashes can act as the entry point of sexually transmitted infections due to breach of skin!\nThere is a common practice of shaving, trimming or removing groin hairs just before sexual encounters. This increases risk of STIs. Thus, hairs should be removed but not just before sexual encounters!\nMore queries are welcomed.','Y','2017-05-10 11:54:33','N'),(25,'expert',287,0,'Please help me to find a Dermatologist for man near JNU / Munirka /Hauz Khash /Malviya Nagar/Saket or In South Delhi. Thanks!',27,'\nDR AMIT LUTHRA\nIshira Clinic S-341, Panchsheel Park, South Delhi, Delhi, Delhi, 110017\nPhone: 098100 62252','Y','2017-05-10 12:42:49','N'),(26,'expert',105,0,'agr Mai bahut logo ke sath with condom sex krta ho. or mujhe apne apko kese hiv se bacha skta ho??',27,'Condom sex ko safer banata hai .100% safe kuch bhi nehi hota. Condom properly pehne , condom ke sath water based lubricants use kare, Condom ke sath tel ghee cream Vaseline use na kare ,is se condom phat sakta hai. Non penetrative sex ek aur tarika hai jis se HIV infection ke risk ko kam kiya ja sakta hai.','Y','2017-05-11 11:49:38','N'),(27,'expert',87,0,'halo sir ji agar panic par oupar dana ho jayei tho kya karna chayea',26,'Penis par dane kai karno se ho sakta hai. STI jaise Syphilis ke symptom ho sakta hai. Agar aise symptom nazar aa rehe ho to Doctor se sampark kare.','Y','2017-05-11 16:55:16','N'),(28,'expert',54,0,'lats  testing..',NULL,NULL,NULL,'2017-05-12 05:34:31','Y'),(29,'expert',115,0,'sunil testing',1,'fjjsjgjdfg','Y','2017-05-12 05:46:08','Y'),(30,'expert',54,0,'vjvjgjgig',1,'--hkf','Y','2017-05-12 05:56:43','N'),(31,'expert',54,0,'vfrvvvbbbbbbb',1,'--ok','Y','2017-05-12 05:59:46','N'),(32,'expert',54,0,'testing...',23,'ok reply','Y','2017-05-12 12:03:00','N'),(33,'expert',57,0,'mene galti se bina condom sex kar liya mujhe sex penis me aage ki taraf urine pass karne ke jalan ho rahi h or discharge karne me bhi jalan ho rahi h me kya karoon',23,'Bina condom k sex karne se gupt rog hone ka khatra bad jaata hai. Peshan me ya discharge karne me jalan inhi gupt rogon ki wajah se bhi ho skti hai. \nYe jalan, sex k doraan ling k chilne ya ghaav ho jaane ki wajah se b ho skte hain. Isiliye hamesha condom ka istemaal karna zaroori hai.\nAbhi aapko apni doctor ko dikhana chaiye, jo dekh kar bta skta hai ki jalan ka karan kya h.','Y','2017-05-12 16:01:22','N'),(34,'expert',71,0,'kya hum ek sath do condom lga kar sex kar sakte h',23,'Do condoms ek saath pehenkar sex nahi karna chaiye kyuki do condom ek saath pehen ne per, dono condom k beech hone waali ragad se, condom fatne k chances badh jaate hain. Condom sex k doraan utar bhi skte hain.','Y','2017-05-12 16:08:19','N'),(35,'expert',52,0,'receiving messages na?',26,'--Yes ','Y','2017-05-17 12:46:25','Y'),(36,'expert',70,0,'dabal condom shi sex kar sakta ha kya',23,'Sex karte waqt do condom ek saath istemaal nhi karne chaiye. Do condom ek saath istemaal karne se condom fatne ka khatra badh jata hai. ','Y','2017-05-18 12:58:39','N'),(37,'expert',114,0,'STD or STI m kya fark h',23,'STI = Sexually Transmitted Infection\nSTD = Sexually Transmitted disease.\nIn dono me sirf itna farak hai jitna infection aur disease me hota hai.\n\nSTI tab kahenge jab, koi germ body me enter kia, body me multiply bhi hua aur ek se doosre ko transmit (phela) bhi hua lekin us germ/microbe ne khud koi bimari nahi karayi sharir ko. Ise STI (infection) bolenge.\nLekin jab wohi microbe/ germ, sharir ko nuksaan pahuchaakar, bimar kardeta hai, tab STD (Disease) kehelayega.\nExample:sex se HPV infection hona STI hai... lekin warts (masse) hona STD hai.','Y','2017-05-22 14:37:02','N'),(38,'expert',56,0,'HIV or AIDS ek he h kya',23,'HIV = Human Immunodeficiency Virus; ye ek virus hai jis se bimari hoti hai, use AIDS kehte hain.\nHIV infection or AIDS ki bimari hone me bhi farak hota hai. HIV infection me virus sirf body me maujud hota lekin AIDS ki bimari hone per wohi maujud virus, body me bimari karwata hai.','Y','2017-05-22 14:47:27','N'),(39,'expert',79,0,'Anti hsv2 lge meaning?',23,'Dear Ajay,\n\nI suppose the term might be either IgG or IgM. \nAnti HSV2 IgG or IgM : ye ek test hota hai.. jis se pata lagaya jata hai ki, body me Herpes (Simplex) infection to nahi hua hai.\nIgG/ IgM titre bade hone par ye anumaan lagaya ja skta hai ki infection naya hai ya purana.','Y','2017-05-22 15:39:25','N'),(40,'expert',79,0,'TPPA/TPHA MEANS ?',23,'TPPA  and TPHA are tests for Syphilis.','Y','2017-05-22 15:49:18','N'),(41,'expert',165,0,'halo sir hiv ka tast kitna time time par kara na chyaa',23,'Hello,\n\nAgar aap sexually active ho to har teen mahine me HIV ka test kara lena chaiye.','Y','2017-05-22 17:16:35','N'),(42,'expert',165,0,'halo sir hiv ka tast kitna time time par karan chyaa',23,'Agar aap sexually active ho to har teen mahine me HIV ka test kara lena chaiye..','Y','2017-05-22 17:19:04','N'),(43,'expert',232,0,'Please help me to find a LGBTQIA+ friendly Counsellor cum Psychologist / Psychiatrist Near Vasant Kunj / Mahipalpur / Gurgaon / South Delhi / Delhi NCR ?? Thanking you in anticipation.',27,'Dear Smit,\nYou can approach the following address for LGBTQIA related counselling support\nThe Humsafar Trust,\n#75, Back Side 1st floor,\nSant Nagar, East of Kailash \nNew Delhi -110065\nFor Psychological support you can visit /call \nSanjivini Society For Mental Health\nA - 6, Satsang Vihar Marg, Qutub Institutional Area, South of IIT, New Delhi, Delhi 110067\nPhone: 011 2686 2222\nThis address is also available in your application.\n\nRegards\n','Y','2017-05-23 13:05:05','N'),(44,'expert',165,0,'thanks sir',23,'Welcome','Y','2017-05-23 17:22:15','N'),(45,'expert',165,0,'halo sir ji agar mai har bar sex karta time condom ka lagata hu tho bi har 3manth mai muja apna hiv tast karan padaga',23,'Hello,\nCondom Istemaal karne se HIV se bacha jaa skta hai. Lekin koi bhi protection 100% safe nhi hoti hai. Kabhi kabhi condom fat jaata hai, ya slip ho jata hai. Aur bhi kayi chote chote kaarano ki wajah se ho sakta (chances kam hain). Isiliye  Har teen mahine pe test kara lena chaiye agar aap sexually active ho to.','Y','2017-05-23 21:01:07','N'),(46,'expert',87,0,'mam mana tast krya ha sti ka or bo theek ha ab muja sti hona ka khtra tho nehi ha abi',23,'STI test sahi aane ka matlab hai ki aap ko koi sti nahi hai. Lekin iska matlab ye nahi hai ki aapko bhavisya me STI nahi ho skti.\nIsiliye safe sex hi karein aur samay samay per jaanch karate rahein','Y','2017-05-24 17:08:58','N'),(47,'expert',56,0,'kya hm do comdom lga kr sex kr skte h kya',23,'Ek saath do condoma laga kar sex karne se, condom (ragad ki wajah se) fat sakta hai ya slip ho skta hai. Isiliye ek saath do condom istemaal nhi karna chaiye.','Y','2017-05-25 12:01:23','N'),(48,'expert',161,0,'kya Dawal condom laga sakta hai sex ka time',23,'Ek saath double condom lagana risky ho skta hai. Ek saath do condom lagane se condom fat skta hai ya slip ho skta hai. Isiliye ek saath me double condom nhi lagana chaiye','Y','2017-05-25 12:02:59','N'),(49,'expert',84,0,'hiv ka ilaj sambhah h?',23,'HIV ka ilaj sambhav hai. ART namak dawaayi khaaker shareer me virus ki maatra kam ki jaa skti hai. \nLekin ye dawai zindagi bhar khaani padti hai... jis se puri zindagi virus bade nahi.','Y','2017-05-25 12:25:37','N'),(50,'expert',74,0,'Hiv sucking krne se b ho skta h kya',23,'Bina condom k sucking karne se HIV hone ka khatra hota hai... lekin ye khatra kaafi kam hota hai..\nLekin doosre yaun rog aasani se ho skte hain. Isiliye sucking condom k saath hi karni chaiye','Y','2017-05-25 19:34:06','N'),(51,'expert',232,0,'Any Free HIV testing center nearby JNU / Ber Sarai / Munirka / Hauz khash?',27,'You can visit Lala Ram swaroop hospital for getting free HIV testing in government Hospital.\nAIDS Health care foundation also conducted free HIV testing.','Y','2017-05-28 10:24:35','N'),(52,'expert',232,0,'Any Free HIV Testing center near JNU / Ber Sarai / Munirka ??',27,'You can visit Lala Ram swaroop hospital for getting free HIV testing in government Hospital. AIDS Health care foundation also conducted free HIV testing.','Y','2017-05-28 10:26:21','N'),(53,'expert',232,0,'Any LOVE Condoms distribution center near by JNU / Munirka / Ber Sarai??',27,'All Government hospitals /testing centers also provided free condoms. \nApart from these Organization like AHF and Pahal foundation working in the area also provide free condoms.','Y','2017-05-28 10:46:22','N'),(54,'expert',96,0,'agar koi bina condom k sex krna chahta h nd vo partner apna sbi test krwa kr without condom sex kr skta h kya??',23,'STI test dono partners ko karwana chaiye. Iske alawa monogamous relationship (matlab sirf ek doosre ke saath hi sex karna chaiye) me rehna chaiye.\nWaise hamesha condom ka istemaal karna chaiye kyuki STD k alawa bhi kayi bimariyaan unprotected sex ki wajah se ho skti hai...','Y','2017-06-02 23:43:05','N'),(55,'expert',59,0,'agar sti ha to sex kar sakhta ha kya',23,'Sex tab tak avoid karna chaiye jab tak sti ka treatment pura na ho jaae. Aur treatment bhi apna aur apne partners ka karwana chaiye.','Y','2017-06-05 12:21:30','N'),(56,'expert',257,0,'hm logo se samaj ke log ghirnaa ku krte h',27,'samaj mai sabhi prakar ke log hote hai. Asa bilkul nehi hai ki sabhi log ghirnaa kare. Bahut log humepyaar aur izat bhi karte hai. Shyaad woh yeh hume jatate nehi hai. Jo log hume pasand nehi karte , hum unhe apne ko izzat dene ke liye mazboor kar sakte hai aapne  kaam ke zareea se.','Y','2017-06-07 15:13:42','N'),(57,'expert',258,0,'hiv kin karan se hota h',23,'HIV in karano se ho skta hai:\n\n- HIV se sankramit vyakti k sath asurakshit yon sambandh banane se.\n- HIV sankramit khoon chadwaane se\n- HIV sankramit maa se, delivery k waqt uske bache me bhi ho skta hai\n- HIV sankramit vyakti dwara istemaal ki gayi suyi ko istemaal karne se. ','Y','2017-06-07 19:58:13','N'),(58,'expert',273,0,'377 kya h',27,'Dhara 377 IPC bharat ke samvidhan ka ek kanoon hai jis main kaha gaya hai ki \"koi bhi sex , jo aprakritic ho aur purus ,mahila ya janwaro ke sath kiya gaya ho; 10 saal ya  jeevan bhar ka karawas ya jurmana ya dono se dandit kiya ja sakta hai\". Yeh kanoon jyadatar samlangik yaktio ko paresan karne ke liye istemal kiya jata hai.','Y','2017-06-11 14:32:38','N'),(59,'expert',276,0,'stigma aur discrimination kya h',27,'Agar koi insaan samaj mai prachlit prathao se alag kuch karete hai aur samaj use swikar nehi karta hai to ise kalank (stigma) kaha jata hai. In kalank ke karan hone wale bhed bhav ko discrimination kehte hai.','Y','2017-06-11 16:22:29','N'),(60,'expert',242,0,'if someone doing cross dressing he not operated now but he identified his self as a transgender.. so what is it is this right statement?????',27,'If a person identifies himself/herself as transgender , According to NALSA judgement , the person will have all the rights even if he/she has not undergone SRS. He/She can avail all the rights and reservation provided through this judgement.','Y','2017-06-12 08:48:23','N'),(61,'expert',52,0,'hey! what is STI?',23,'STI is Sexually Transmitted Infections. Any infection transmitted while having sex is sexually transmitted infection.\n\nHindi me STI ko yon rog/ gupt rog ya janaango ki bimaari bhi kaha jaata hai. Ye wo rog hote hain jo pidit vyakti k saath yon sambandh bnaane se hote hain.','Y','2017-06-12 16:42:18','N'),(62,'expert',285,0,'trasgander  ko bhi koi kanuni adhikar h kya',27,'Supreme court ne NALSA judgement ke tahat Transgender ko kai kanuni adhikar diye hai jaise ki education institution mai reservation; medical care separate toilet  etc.','Y','2017-06-14 13:35:50','N'),(63,'expert',288,0,'h.i.v or aids me kya defrence hai',23,'HIV = Human Immunodeficiency Virus; ye ek virus hai jis se bimari hoti hai, use AIDS kehte hain. HIV infection or AIDS ki bimari hone me bhi farak hota hai. HIV infection me virus sirf body me maujud hota lekin AIDS ki bimari hone per wohi maujud virus, body me bimari karwata hai.','Y','2017-06-14 15:24:03','N'),(64,'expert',287,0,'h iv hone par kiya karna chaye',23,'HIV ka test positive hone k baad test confirm karane k liye ICTC centre bheja jaata hai. Agar wahan bhi test positive aata hai to ART centre pe bheja jata hai. Wahan per CD4 aur kafi saari jaanchein hoti hain jinke baad dawaayi shuru ki jaati hain. \nDawaaiye time se leni chaiye or har 6 mahine per niyamit jaanch karani chaiye. \n\nAchaa khaana aur puri neend leni chaiye. Exercise bhi karni chaiye.','Y','2017-06-14 18:20:33','N'),(65,'expert',287,0,'h iv hone par kiya kiya hota he',23,'Hiv infection hone per HIV ka virus shareer me ghus jata hai or shareer ko kamzor kardeta hai. Treatment na hone per, dheere dheere ye shareer ki dusri beemariyon se ladne ki shamta ko kam kardeta hai. Jis se kafi saari doosri bimaariyaan hone lagti hain.','Y','2017-06-14 18:21:38','N'),(66,'expert',263,0,'sti ki bimari tik hoti h ya ni',23,'STI (Yon Rog)\nAgar Yon rog bacteria ki wajah se huye hain to dawaai lene se puri tarah se thik ho jaate hain.\nAgar yon rog virus ki wajah se hua hai, to dawai khaane se control ho jata hai.\nYon rog hone per treatment karana zaroori hai.','Y','2017-06-17 17:36:47','N'),(67,'expert',313,0,'hlo mam srs kha hota hai',27,'SRS ek aisi cosmetic prakriya hai jis se operation dwara Ling ko yoni jaisa banaya jata hai. Yoni ko bhi ling jaisa banaya ja sakta hai. Yeh keval cosmetic operation hota hai . ','Y','2017-06-17 22:06:45','N'),(68,'expert',314,0,'mere ko h i v h me kya karu',23,'HIV se ghabraayein nahi!\nAap pehle ICTC Centre jaakr apni jaanch dobara karwayein. Yadi wahan per bhi result positive hua to wahan se aapko ART centre bheja jaaega. ART Centre me aapki jaanchein hongi or dawaai bhi shuru ki jaa skti hai. Niyamit samay se dawaai lein, achaa or niyamit samay se khana khaayein, puri neend lein or infections se apna bachaav karein! \n\nAgar aapko lagta hai ki aapko zyada tanaav hai to aap kisi counselor se milkar baat bhi kar skte hain. ','Y','2017-06-20 00:27:56','N'),(69,'expert',231,0,'Mere muh mai ak white color ka dana hogya hai kya yeh STI ho skta hai',23,'White colour ka dana kafi saari cheezon ki wajah se ho skta hai. Ye agar chaala hai to ye normal chaala bhi ho skta hai (vitamin ki kami se) ya sti ka chala bhi ho skta hai hai... kabhi kabhi tobacco k chaale ki wajah se isme cancer bhi ho skta hai..\nLekin bina dekhe or jaanch karwaae kuch nhi kaha jaa skta. Isi liye jaanch karaana zaroori hai.','Y','2017-06-20 23:37:20','N'),(70,'expert',251,0,'which STI disease are biggest causes of death?',23,'As in nearly all STIs are treatable when diagnosed early. But the STI considered to life risky are HIV and Hepatitis B.','Y','2017-06-21 10:28:25','N'),(71,'expert',325,0,'kya STI  lailaj hoti h',23,'Nahi STI lailaj nahi hoti.\nSTI ka ilaaj sambhav hai agar samay per janch karali jaae to.','Y','2017-06-22 17:33:55','N'),(72,'expert',232,0,'If I am using condom regularly; then going for a HIV test for once or twice in a year is a good practice or its not important? Because in last test Its comes negative and I am using condoms regularly.',23,'Its good to use condom regularly and get yourself tested for HIV. Its a good practice. \nThough it is recommended to do it after 3 months.\nYou should get yourself tested for HIV after 6 months.','Y','2017-06-22 19:09:20','N'),(73,'expert',321,0,'me sir lab pe kam karte hu cafes nahi phen ta ta hu kiya HIV HO SAKATA H',27,'HIV sirf sankramit waqti ke sairik taral padarth ke adan pradan se ho sakta hai. App Lab main kaam karte waqt universal safety precaution aapnay jis se aap ka risk kam hosake.','Y','2017-06-24 16:33:27','N'),(74,'expert',321,0,'sir 5 6 mahine m Abel sex karta hu sefly karte hu kiya ho sakta h',27,'Humesa safer sex techniques appnay is se aap ka HIV/STI ka risk kam hoga aur aap surakshit reh sakte ho .','Y','2017-06-24 16:35:17','N'),(75,'expert',396,0,'I want to hiv testing myself',27,'You can get yourself tested at any government ICTC  near you. The list of ICTC  are provided in resource list in the app.','Y','2017-07-09 14:49:17','N'),(76,'expert',79,0,'can aids revert back to hiv?',23,'AIDS is roughly a situation when HIV virus destroys immunity to an extent that the person suffers from opportunistic infections and health issues related to AIDS. \n\nYeah, the stage of AIDS can revert back to the stage of HIV seropositivity if optimum care and treatment is provided to the patient! The process may take time and high level of dedication!','Y','2017-07-10 16:15:33','N'),(77,'expert',426,0,'m feel scread for do hiv test',23,'HIV test karwaane se darna nahi chaiye. Ye bahut hi aasaan test hota hai jis se aapko pata chal jaaega ki aapko HIV infection hai yaa nahin.\n\nHIV status pata hona, apne aap ko swastha rakhne k liye kafi zaroori hota hai. \nAgar test negative hai.. to aap aage precaution ka istemaal karke surakhshit reh sakte hain.\nAgar test positive aata hai, tab bhi ghabraane ki koi baat nahi hai. HIV ka pata chalne per aapki jaanche hongi or unke anusaar aapko dawai bhi di jaaengi jinse aap zindagi bhar swastha or lambi zindagi guzaar skte hain.\nAgar aap positive hain or test nhi karaya or treatment nhi lia to HIV ka virus body me badta chala jaega or kafi nuksaan pahucha skta hai. Isiliye samay per pata lagaana zaroori hai.\n\nPata hona hi suraksha hai..','Y','2017-07-13 16:34:26','N'),(78,'expert',321,0,'sir me medical lab ka kam karta hu  kabhi kabhi hath per bilood for jata h to kiya chances hiv  hone k plese emediyatli give me ans',23,'Sirf blood lagne se chances nahi hote HIV hone ke. Needle injury k upar blood lagne se 0.1 % chances hote hai. Lab workers ko hamesha gloves ka or anya universal precautions follow karne chaiye.\n\nAgar blood exposure hua hai to blood ki HIV test karwaake, Lab incharge ko inform karna chaiye. agar blood infected hai, to post exposure prophylaxis namak dawaai zaroor leni chaiye.\n\n','Y','2017-07-15 09:10:31','N'),(79,'expert',321,0,'VDRL TEST KIS DISES K LIYE  KIYA JATA H',23,'VDRL Test Syphilis k liye kia jata hai.','Y','2017-07-15 09:15:50','N'),(80,'expert',321,0,'agr kisi bande ko hiv ho gaya use pata nahi ya test nahi karwaya to uske lakshan kitne sal ya mahine me asar dikhye ga',23,'HIV infection agar pata na chale to teen stages hoti hain:\n1. Acute HIV infection: ye stage Infection hone k 2 - 4 week me hoti hai.. isme flue jaise symptom hote hain: bhukhaar, zukhaam, surdard, badan dard ... lekin ye zukhaam waali stage jald hi apne aap thik ho jaati hai.\n2. Chronic HIV infection: Pehli waali stage k baad, doosri stage me kuch nahi hota hai.. sirf body ki guiltiyaan badti rehti hain... treatment naa hone per... ye stage AIDS ki stage tak pahucha deti hai...  chronic HIV infection ko AIDS waali stage me pahuchne me maximum 10 saal tak lag sakte hain.\n3. AIDS : Isme HIV ka virus body ki pratirodhak pranali ko itna barbaad kardeta hai ki kayi tarh k infection hone lagte hain or cancers hone ka bhi khatra bad jaata hai.\n\nAgar sahi samay per jaanch kara li jaae or treatment shuru ho jaae to in sabhi complications se bacha jaa skta hai.','Y','2017-07-20 11:31:08','N'),(81,'expert',321,0,'hi rishk me kon log jiyada hote h sir 1 week me kitni bar was karna chiye',23,'Agar un populations ki baat ki jaae jo HIV or STI k zyada jokhim per hoti hain: \nSex workers, MSM, Injecting Drug Users, Sex workers k clients, long distance truck drivers.. \n\nAapka doosra sawaal samjh nahi aaya.. kripya dobara bhejein.','Y','2017-07-20 11:35:32','N'),(82,'expert',321,0,'gay continuity me sir top ko jiyda risk hota ya bottom and uñ protect sex krne me anel sex jiyada rishk hota h ya viejina se',23,'Gay community me un partners ko zyada risk hota hai jo bottom hote hain.\n\nAgar risk k hisaab se dekhaa jaae to unprotected sex hamesha hi risky hota hai.\nAnal sex zyada risky hota hai vaginal sex k muqabale me...\nRisk k hisaab se dekhaa jaae to:\nAnal sex > vaginal sex>> oral sex','Y','2017-07-20 11:40:07','N'),(83,'expert',356,0,'what is the benefits of NALSA judgment',27,'NALSA judgement provides a window to address the key issue of Transgender by granting legal recognition. It also made sex reassignment surgery non mandatory for being recognized as Transgender. This judgement also directed the Government to frame social welfare scheme for TG besides quota in reservation at educational institutes.  ','Y','2017-07-25 19:25:00','N'),(84,'expert',54,0,'testing',NULL,NULL,NULL,'2017-08-10 18:00:33','Y'),(85,'expert',48,0,'Am i safe and secure',27,'If you indulge in unsafe behavior, you can make yourself safer by adopting safer sex practice . If you have indulged in unsafe practice , then visit the  nearest ICTC center after the window period is over. ','Y','2017-08-22 11:25:45','N'),(86,'expert',52,0,'test leena',26,'yes','Y','2017-08-23 13:44:54','Y'),(87,'expert',387,0,'what is skin problems in hiv effect',23,'As HIV decreases the immunity of the patient, a wide range of skin conditions could be seen:\n1. Seroconversion rash (Develops in few weeks of acquiring HIV infection along with swollen lymph nodes and flue like symptoms)\n2. Rashes due to allergic reactions to HIV medications\n3. Cellulitis (Infection to deep layers of skin leading to swelling and pain)\n4. Herpes Rashes\n5. Rashes of Herpes zoster (with intense burning)\n6. Molluscum rashes (umblicated rashes)\n7. Folliculitis (Infection of Hair Follicles)\n8. Dermatitis (Itchy rashes with scaly plaques)\n9. Psoriasis (Rashes with scales and plaques)\n10. Scabies \n11. Wide range of Fungal infections\n12. Skin Cancers (at a level of severe immunosupression)','Y','2017-08-26 13:59:43','N'),(88,'expert',387,0,'without condom oral sex in dangerous in hiv aids',23,'The risk of acquiring HIV in oral sex is less than 1%. In this spectrum, the risk could be greater for receptive partner than for insertive partner. Circumcision further reduces the risk to negligible levels.  Thus, Oral sex has lower risk.','Y','2017-08-28 16:51:53','N'),(89,'expert',263,0,'prep kya h',23,'Prep ka matlab hai Pre exposure prophylaxis. Ye wo dawaaiyan hai jinko lene se ek vyakti, jo Hiv hone ke high risk behaviour me hai, hiv infection k hone se bach sakta hai. Ye dawaaiyan HIV hone se rokti hain. Ye roz leni hoti hainn','Y','2017-09-03 06:44:00','N'),(90,'expert',48,0,'ghjjjdbbdb',26,'Answer to your question :)','Y','2017-09-07 11:46:38','N'),(91,'expert',48,0,'what is hiv?',26,'--HIV is human immune deficiency virus. ','Y','2017-10-04 12:18:47','N'),(92,'expert',433,0,'sti kya h',27,'STI yani Sexually transmitted infection . Asi bimari jo asurakshit yaan vabhayar dwara failta ho unhe STI kehte hai. ','Y','2017-10-10 17:46:02','N'),(93,'expert',433,0,'or hiv kis tarh se hota h',27,'HIV sirf char tarah se fail sakta hai\r\n1) Sankramit rakt charane se\r\n2)Sankramit sui istemal karnese\r\n3)Sankramit ma se hone wale bacche mai\r\naur\r\n4)Asurakshit yaun sambandh se','Y','2017-10-10 17:47:05','N');

