/* Procedure structure for procedure `proc_graph` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_graph` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_graph`(
/*
CALL proc_graph('English','age','')
CALL proc_graph('English','quizPercentage','')
CALL proc_graph('English','profileAnswer','1')
*/
p_language varchar(55),
p_type varchar(55) ,
p_questionId varchar(55)   
    )
BEGIN
if p_type='age'
then
select ageFrom,ageTo,counts from  
(SELECT 15 ageFrom,25 ageTo, COUNT(age)counts  
FROM tbl_users 
WHERE deleted='N'
AND otpVerify='Y' 
AND userType='User'
AND  age BETWEEN 15 AND 25
UNION
SELECT 26 ageFrom,35 ageTo, COUNT(age)counts  
FROM tbl_users 
WHERE deleted='N'
AND otpVerify='Y' 
AND userType='User'
AND  age BETWEEN 26 AND 35
UNION
SELECT 36 ageFrom,45 ageTo, COUNT(age)counts  
FROM tbl_users 
WHERE deleted='N'
AND otpVerify='Y' 
AND userType='User'
AND  age BETWEEN 36 AND 45
UNION
SELECT 46 ageFrom,55 ageTo, COUNT(age)counts  
FROM tbl_users 
WHERE deleted='N'
AND otpVerify='Y' 
AND userType='User'
AND  age BETWEEN 46 AND 55
UNION
SELECT 56 ageFrom,65 ageTo, COUNT(age)counts  
FROM tbl_users 
WHERE deleted='N'
AND otpVerify='Y' 
AND userType='User'
AND  age BETWEEN 56 AND 65
UNION
SELECT 66 ageFrom,75 ageTo, COUNT(age)counts  
FROM tbl_users 
WHERE deleted='N'
AND otpVerify='Y' 
AND userType='User'
AND  age BETWEEN 66 AND 75
UNION
SELECT 76 ageFrom,85 ageTo, COUNT(age)counts  
FROM tbl_users 
WHERE deleted='N'
AND otpVerify='Y' 
AND userType='User'
AND  age BETWEEN 76 AND 85
UNION
SELECT 86 ageFrom,95 ageTo, COUNT(age)counts  
FROM tbl_users 
WHERE deleted='N'
AND otpVerify='Y' 
AND userType='User'
AND  age BETWEEN 86 AND 95)z
where counts>0;
end if;
IF p_type='quizPercentage'
then
SELECT 'Above 80%'`type`,COUNT(createdBy)counts
FROM 
(SELECT createdBy,correct,total,
correct/total*100 percentage
FROM 
(SELECT a.createdBy,correct,total FROM 
(SELECT createdBy,COUNT(id)correct 
FROM tbl_surveytrans WHERE rating=1
AND surveyId  IN (3,4,5,6,7)
and createdBy in (select userId from tbl_users 
WHERE deleted='N'
AND otpVerify='Y' )
GROUP BY createdBy)a
JOIN
(SELECT createdBy,COUNT(id)total 
FROM tbl_surveytrans WHERE 
surveyId  IN (3,4,5,6,7)
AND createdBy IN (SELECT userId FROM tbl_users 
WHERE deleted='N'
AND otpVerify='Y' )GROUP BY createdBy)b
ON a.createdBy=b.createdBy)Z
WHERE total=50)ZZ
WHERE percentage>=80
UNION
SELECT 'Below 80%'`type`,COUNT(createdBy)counts
FROM 
(SELECT createdBy,correct,total,
correct/total*100 percentage
FROM 
(SELECT a.createdBy,correct,total FROM 
(SELECT createdBy,COUNT(id)correct 
FROM tbl_surveytrans WHERE rating=1
AND surveyId  IN (3,4,5,6,7)
AND createdBy IN (SELECT userId FROM tbl_users 
WHERE deleted='N'
AND otpVerify='Y' )GROUP BY createdBy)a
JOIN
(SELECT createdBy,COUNT(id)total 
FROM tbl_surveytrans WHERE 
surveyId  IN (3,4,5,6,7)
AND createdBy IN (SELECT userId FROM tbl_users 
WHERE deleted='N'
AND otpVerify='Y' )GROUP BY createdBy)b
ON a.createdBy=b.createdBy)Z
WHERE total=50)ZZ
WHERE percentage<80;
END IF;
IF p_type='profileAnswer'
THEN
SELECT questionId,(SELECT question FROM tbl_survey_question 
WHERE tbl_survey_question.surveyId=tbl_surveytrans.surveyId 
AND tbl_survey_question.questionId=tbl_surveytrans.questionId 
AND tbl_survey_question.deleted='N')question,
answerId,(SELECT answer FROM tbl_survey_answer 
WHERE tbl_survey_answer.surveyId=tbl_surveytrans.surveyId 
AND tbl_survey_answer.questionId=tbl_surveytrans.questionId 
AND tbl_survey_answer.answerId=tbl_surveytrans.answerId 
AND tbl_survey_answer.deleted='N')answer,
COUNT(createdBy)counts
FROM tbl_surveytrans
WHERE surveyId=1
and questionId=p_questionId
and createdBy in (select userId from tbl_users WHERE deleted='N'AND otpVerify='Y'AND userType='User')
AND deleted='N'
GROUP BY questionId,answerId;
end IF;
    END */$$
DELIMITER ;

