DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_news_iud`(
/*
Procedure Name - proc_news_iud
Purpose        - To send news in different types of tbl_users
Author         - Shashank Chauhan
Date           - 30/12/2016
CALL proc_news_iud(3,NULL,'All',NULL,NULL,NULL,NULL,NULL)
*/
    p_mode INT,
    p_newsType VARCHAR(50),
    p_newsFrom VARCHAR(11),
    p_newsTo VARCHAR(11),
    p_newsHead VARCHAR(255),
    p_newsDesc TEXT,
    p_newsImage VARCHAR(100)
    )
BEGIN
     IF p_mode = 0
