    SELECT newsId,newsHead,newsDesc,newsTo,newsType,deleted,DATE_FORMAT(createdDate,'%d-%m-%Y')  newsDate,(SELECT userName FROM tbl_users WHERE userId=newsFrom)  newsFrom 
    ,CONCAT((SELECT `value` FROM tbl_parameter WHERE `name`='URL'),'uploads/newsImage/',newsImage)AS newsImg,
    DATE_FORMAT(createdDate,'%a, %d %b %Y %H:%i')createDate  
    FROM tbl_news WHERE  deleted='N' ORDER BY createdDate DESC;
