/* Procedure structure for procedure `proc_notification_iud` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_notification_iud` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_notification_iud`(
/*
Procedure Name - proc_notification_iud
Purpose        - To send notification in different types of users
Author         - Shashank Chauhan
Date           - 30/12/2016
CALL proc_notification_iud('0','','All','6','8','Hi','HI to All!!!!!')
*/
   p_mode INT,
   p_notificationType VARCHAR(25),
   p_notificationFrom VARCHAR(50),
   p_notificationTo VARCHAR(50),
   p_notificationHead VARCHAR(50),
   p_notificationDesc VARCHAR(255)
   )
BEGIN
   IF p_mode = 0
   THEN
   
   INSERT INTO tbl_notification (notificationType,notificationHead,notificationDesc,notificationFrom,notificationTo)
   VALUES (p_notificationType,p_notificationHead,p_notificationDesc,p_notificationFrom,p_notificationTo);
   
   SELECT userId,gcmId ,notificationHead,notificationDesc,notificationType,tbl_notification.createdDate
   FROM tbl_users,tbl_notification
   WHERE userId IN (SELECT userId FROM `tbl_usernotificationsetting` 
                    WHERE userId=CASE WHEN p_notificationTo='All' THEN userId ELSE  p_notificationTo END 
   
   AND pushNotifications='Y'
  )
  AND notificationId=(SELECT MAX(notificationId) FROM tbl_notification WHERE deleted='N');
  END IF;
  
IF p_mode = 3
   THEN
/*SELECT `notificationId`,`notificationType`,`notificationHead`,
`notificationDesc`,`notificationFrom`,`notificationTo`,
CASE WHEN notificationTo='All' THEN 'All Users' ELSE (SELECT userName 
FROM tbl_users WHERE userId=notificationTo) END notificationTo,`createdDate`,`deleted`,
(SELECT userName FROM tbl_users WHERE userId=notificationTo)`name`,
(SELECT email FROM tbl_users WHERE userId=notificationTo)email,
(SELECT mobile FROM tbl_users WHERE userId=notificationTo)mobile
FROM tbl_notification WHERE deleted='N' 
ORDER BY createdDate DESC;  */
SELECT 'Admin' AS userName,notificationHead,notificationDesc,'notification' AS notificationMessage,date_format(createdDate,'%d-%m-%Y %H:%i')createdDate,
createdDate AS setDate
 from tbl_notification where notificationTo in (p_notificationFrom,'All') and deleted='N'
 union
 SELECT (SELECT concat(ifnull(firstName,''),' ',ifnull(lastName,'')) FROM tbl_users WHERE userId=replyBy) AS userName,
messageText AS notificationHead,
replyText AS notificationDesc,
'message' AS notificationMessage,
DATE_FORMAT(createdDate,'%d-%m-%Y %H:%i')createdDate,
createdDate as setDate
 FROM tbl_message WHERE messageFrom = p_notificationFrom AND replyStatus='Y' AND deleted='N' order by setDate desc;
END IF;
      
  END */$$
DELIMITER ;

